(92, 'general.gdpr.agreement.agreement_label', 'I agree with the terms and conditions.', 'default', 'en', '2025-04-02 07:01:04', '2025-04-02 07:01:04'),
(93, 'general.gdpr.agreement.agreement_content', '<p><strong>General Data Protection Regulation (GDPR) Agreement</strong></p>\r\n<p><strong>Effective Date:</strong> [Insert Date]</p>\r\n<p><strong>1. Introduction</strong><br>This GDPR Agreement (\"Agreement\") outlines the data protection measures adopted by <strong>[Your Company Name]</strong> (\"Company\") in compliance with the General Data Protection Regulation (GDPR). It applies to all users of <strong>Bagisto</strong> (\"Platform\") and governs the collection, processing, and storage of personal data.</p>\r\n<p><strong>2. Data Collection and Processing</strong><br>We collect and process personal data solely for the purpose of providing, improving, and securing our services. Personal data may include, but is not limited to:</p>\r\n<ul>\r\n<li>\r\n<p>Name, email address, and contact information</p>\r\n</li>\r\n<li>\r\n<p>Billing and shipping details</p>\r\n</li>\r\n<li>\r\n<p>Order history and preferences</p>\r\n</li>\r\n<li>\r\n<p>IP address and device information</p>\r\n</li>\r\n</ul>\r\n<p><strong>3. Lawful Basis for Processing</strong><br>We process personal data under the following lawful bases:</p>\r\n<ul>\r\n<li>\r\n<p><strong>Consent:</strong> When users voluntarily provide data for specific purposes.</p>\r\n</li>\r\n<li>\r\n<p><strong>Contractual Necessity:</strong> To fulfill service agreements or orders.</p>\r\n</li>\r\n<li>\r\n<p><strong>Legitimate Interest:</strong> To enhance security and user experience.</p>\r\n</li>\r\n<li>\r\n<p><strong>Legal Compliance:</strong> When required by law.</p>\r\n</li>\r\n</ul>\r\n<p><strong>4. Data Subject Rights</strong><br>As per GDPR, users have the following rights:</p>\r\n<ul>\r\n<li>\r\n<p>Right to access personal data</p>\r\n</li>\r\n<li>\r\n<p>Right to rectification of incorrect data</p>\r\n</li>\r\n<li>\r\n<p>Right to data portability</p>\r\n</li>\r\n<li>\r\n<p>Right to erasure (\"Right to be forgotten\")</p>\r\n</li>\r\n<li>\r\n<p>Right to restrict processing</p>\r\n</li>\r\n<li>\r\n<p>Right to object to data processing</p>\r\n</li>\r\n<li>\r\n<p>Right to lodge a complaint with a supervisory authority</p>\r\n</li>\r\n</ul>\r\n<p><strong>5. Data Security and Storage</strong><br>We implement industry-standard security measures to protect personal data. User data is stored securely and retained only as long as necessary. In case of a data breach, affected users will be notified as per GDPR requirements.</p>\r\n<p><strong>6. Third-Party Data Sharing</strong><br>We do not sell or share personal data with third parties, except when necessary for service delivery (e.g., payment gateways, shipping providers) or when required by law.</p>\r\n<p><strong>7. Changes to This Agreement</strong><br>We reserve the right to update this Agreement. Users will be notified of significant changes via email or platform notifications.</p>\r\n<p><strong>8. Contact Information</strong><br>For any GDPR-related inquiries, users can contact us at:<br>[Your Company Contact Information]</p>\r\n<p>By using Bagisto, you acknowledge and agree to the terms outlined in this GDPR Agreement.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:13'),
