(97, 'general.gdpr.cookie.description', 'This website uses cookies to ensure you get the best experience on our website.', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
(98, 'general.gdpr.cookie_consent.strictly_necessary', '<p>I agree with the terms and conditions.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
(99, 'general.gdpr.cookie_consent.basic_interaction', '<p>These trackers enable basic interactions and functionalities that allow you to access selected features of our service and facilitate your communication with us.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
(100, 'general.gdpr.cookie_consent.experience_enhancement', '<p>These trackers help us to provide a personalized user experience by improving the quality of your preference management options, and by enabling the interaction with external networks and platforms.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
(101, 'general.gdpr.cookie_consent.measurements', '<p>These trackers help us to measure traffic and analyze your behavior with the goal of improving our service.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
(102, 'general.gdpr.cookie_consent.targeting_advertising', '<p>These trackers help us to deliver personalized marketing content to you based on your behavior and to operate, serve and track ads.</p>', 'default', 'en', '2025-04-02 07:01:05', '2025-04-02 07:01:05'),
