(647, 'en', 'default', 'Step into sophistication with our Skyline Elegance High Rise Slim Fit Women\'s Jeans. The high rise design, coupled with a slim fit, offers a modern and flattering silhouette. Made from premium denim, these jeans provide both comfort and durability. Elevate your style effortlessly with this versatile wardrobe essential.', NULL, NULL, NULL, NULL, NULL, NULL, 54, 9, 'default|en|54|9'),
(648, 'en', 'default', 'Introducing Skyline Elegance High Rise Slim Fit Women\'s Jeans, a harmonious blend of contemporary design and timeless comfort. These jeans feature a high rise design, providing a modern silhouette that elongates your legs and flatters your figure. The slim fit accentuates your natural curves, offering a sleek and chic appearance.\r\n\r\nCrafted from a premium cotton-elastane blend, the denim used in these jeans ensures durability, comfort, and a touch of stretch for ease of movement. The classic five-pocket styling adds both style and convenience to your everyday wear.\r\n\r\nThe button and zipper closure not only secure the jeans in place but also contribute to the overall stylish finish of the garment. Versatile and trendy, these jeans can be effortlessly paired with a variety of tops and shoes, making them suitable for different occasions and outfit styles.\r\n\r\nElevate your fashion game and embrace the sophistication of Skyline Elegance High Rise Slim Fit Women\'s Jeans. Experience the perfect balance of comfort, style, and durability with this essential piece for every fashion-forward woman. Let these jeans redefine your wardrobe and make a statement wherever you go.', NULL, NULL, NULL, NULL, NULL, NULL, 54, 10, 'default|en|54|10'),
