(705, 'en', 'default', 'Introducing the AeroFit Women\'s Fitness Performance Jacket, your ultimate companion for an active lifestyle. This jacket is designed to provide optimal comfort and functionality during your workouts, whether you\'re hitting the gym or going for a run.\r\n\r\nCrafted from a premium polyester-spandex blend, it offers a lightweight and breathable experience. The moisture-wicking technology efficiently draws away sweat, keeping you cool and dry even during intense exercise sessions.\r\n\r\nThe full zip closure allows for easy wear and additional ventilation, adapting to your comfort needs. Elastic cuffs and hem ensure a secure fit, providing freedom of movement without any distractions. The jacket features zippered pockets for convenient storage of your essentials while on the move.\r\n\r\nVersatile and stylish, the AeroFit Women\'s Fitness Performance Jacket is not just for the gym - it\'s perfect for jogging and various forms of active wear. Embrace the active lifestyle with this jacket that blends fashion and functionality seamlessly. Elevate your fitness game, embrace comfort, and conquer your workouts with AeroFit.', NULL, NULL, NULL, NULL, NULL, NULL, 59, 10, 'default|en|59|10'),
