(830, 'en', 'default', 'Step into timeless style with our Classic Elegance Men\'s Black Lace-Up Formal Shoes. These classic formal shoes feature a lace-up design that exudes sophistication and elegance, perfect for formal occasions. The comfortable fit ensures you can wear them all day during events, and the high-quality genuine leather promises long-lasting performance.', NULL, NULL, NULL, NULL, NULL, NULL, 69, 9, 'default|en|69|9'),
(831, 'en', 'default', 'Introducing our Classic Elegance Men\'s Black Lace-Up Formal Shoes, a pair of shoes that define timeless style and elegance.\r\n\r\nThese classic formal shoes feature a classic lace-up design that\'s ideal for formal occasions where sophistication is key. Whether you\'re attending professional meetings, weddings, upscale gatherings, or any formal event, these shoes are the perfect choice to complete your look.\r\n\r\nThe comfortable fit of these shoes allows you to wear them throughout extended events without any discomfort. The high-quality and durable genuine leather construction ensures that these shoes not only look elegant but also perform exceptionally well, withstanding the test of time.\r\n\r\nStep into a world of classic style and timeless elegance with Classic Elegance Men\'s Black Lace-Up Formal Shoes. These shoes are more than just footwear; they are a symbol of your impeccable taste and your appreciation for classic fashion. Make a lasting impression at every formal event with these timeless and elegant lace-up formal shoes.', NULL, NULL, NULL, NULL, NULL, NULL, 69, 10, 'default|en|69|10'),
