(935, 'en', 'default', 'Empower the trendsetters of tomorrow with Young Trendsetter Boys\' Designer and Fashionable Running Shoes. These stylish and designer shoes are perfect for young individuals who want to make a fashion statement while staying active. Designed for sports, active pursuits, and everyday adventures, they offer comfort, durability, and a secure fit with a lace-up closure.', NULL, NULL, NULL, NULL, NULL, NULL, 75, 9, 'default|en|75|9');
