(991, 'en', 'default', 'Step into comfort and style with Pink Bliss Casual Sport Shoes. These pink sport shoes feature a flat heel and a versatile design, making them suitable for a range of casual occasions. Lightweight and comfortable, they are perfect for all-day wear. Crafted from breathable materials, they keep your feet fresh and active, while the non-slip sole ensures added safety.', NULL, NULL, NULL, NULL, NULL, NULL, 84, 9, 'default|en|84|9'),
(992, 'en', 'default', 'Pink Bliss Casual Sport Shoes are your go-to footwear for a stylish and comfortable experience on casual occasions.\r\n\r\nThe pink design of these sport shoes adds a touch of femininity to your outfit, making them a perfect choice for various casual occasions. Whether you\'re heading to a weekend brunch, a shopping trip, or a leisurely stroll in the park, these shoes complement your style effortlessly.\r\n\r\nComfort is a priority, and these shoes deliver. The flat heel and lightweight design ensure that your feet remain comfortable all day long. You can count on them for both comfort and style.\r\n\r\nBreathable materials are used to keep your feet feeling fresh and active, even during extended wear. This feature is especially important when you\'re on the move, as it prevents discomfort from perspiration.\r\n\r\nSafety is also considered, with a non-slip sole that offers added stability. This feature ensures that you can walk with confidence, knowing that you\'re well-supported.\r\n\r\nStep into comfort and style with Pink Bliss Casual Sport Shoes. These shoes are more than just footwear; they are a reflection of your active and stylish lifestyle. Let your feet step into a world of comfort and fashion, allowing you to enjoy your casual occasions with ease and confidence.', NULL, NULL, NULL, NULL, NULL, NULL, 84, 10, 'default|en|84|10'),
