(1572, 'en', 'default', 'Keep your little one warm and stylish with our Smart Winter Hoodie for Boys in Red and Blue. This hoodie features a dual-tone design in red and blue, making it a smart choice for the winter season. Crafted from a warm and insulating material, it\'s perfect for various winter outings, ensuring your child stays cozy and trendy.', NULL, NULL, NULL, NULL, NULL, NULL, 136, 9, 'default|en|136|9'),
(1573, 'en', 'default', 'Introducing our Smart Winter Hoodie for Boys in Red and Blue, a must-have for the chilly days. This hoodie features a dual-tone design, combining vibrant red and cool blue to create a smart and stylish look for your little one.\r\n\r\nCrafted from a warm and insulating polyester blend, this hoodie is designed to keep your child cozy and comfortable during the winter season. The hood adds extra warmth and style, making it a versatile piece for various winter outings.\r\n\r\nThe front zipper closure allows for easy wear and removal, providing convenience for your child. Whether it\'s a trip to the park, a casual day at school, or a family outing, this hoodie is the perfect choice to keep your little boy both warm and fashionable.\r\n\r\nLet your child embrace the winter season with confidence and style in our Smart Winter Hoodie for Boys in Red and Blue. It\'s a versatile and trendy addition to his wardrobe, ensuring he stays cozy and smart throughout the chilly months.', NULL, NULL, NULL, NULL, NULL, NULL, 136, 10, 'default|en|136|10'),
