(2666, 'en', 'default', 'Stay cool and comfortable during your workouts with our FlowMotion Women\'s Quick-Dry Fitness Tank Top. The quick-dry fabric ensures a sweat-free workout, while the loose and relaxed fit offers ultimate comfort. This tank top is perfect for the gym, yoga, or even casual wear. Embrace the flow with FlowMotion.', NULL, NULL, NULL, NULL, NULL, NULL, 208, 9, 'default|en|208|9'),
(2667, 'en', 'default', 'Introducing FlowMotion Women\'s Quick-Dry Fitness Tank Top - your go-to choice for a breezy and comfortable workout experience. Crafted from high-quality polyester, this tank top offers a quick-dry feature, effectively managing sweat and providing a dry and comfortable feel throughout your workout.\r\n\r\nThe racerback design enhances mobility, allowing you to move freely during exercises. The loose and relaxed fit adds to the comfort, making it perfect for the gym, yoga, or even casual wear. The lightweight and breathable material ensure that you stay cool and refreshed.\r\n\r\nEmbrace the flow of your workouts and the modern, trendy design of FlowMotion Women\'s Quick-Dry Fitness Tank Top. Elevate your active look, stay comfortable, and make a statement wherever you go. Flow through your fitness journey in style and ease with this tank top.', NULL, NULL, NULL, NULL, NULL, NULL, 208, 10, 'default|en|208|10'),
