(2772, 'en', 'default', 'Experience seamless comfort during your workouts with our FlexActive Women\'s Seamless Workout Wear. These stylish Workout Wear offer a flattering fit and ultimate flexibility, perfect for the gym, yoga, running, or any fitness activity. Stay dry and stylish with FlexActive.', NULL, NULL, NULL, NULL, NULL, NULL, 214, 9, 'default|en|214|9'),
(2773, 'en', 'default', 'Introducing FlexActive Women\'s Seamless Workout Wear, the epitome of comfort and style in activewear. The seamless design provides a smooth and comfortable fit, eliminating any irritation during your workout. The high-quality design not only offers a flattering silhouette but also enhances support during your exercises.\r\n\r\nCrafted from a premium nylon-spandex blend, these active wear offer a four-way stretch, providing unrestricted movement and flexibility. The moisture-wicking fabric keeps you dry by efficiently wicking away sweat, and the breathable, quick-drying material ensures a comfortable workout experience.\r\n\r\nWhether you\'re hitting the gym, practicing yoga, going for a run, or engaging in any fitness activity, these are your go-to choice. Embrace the seamless comfort, the flattering fit, and the versatility of FlexActive Women\'s Seamless Workout Wear. Elevate your fitness journey and conquer your workouts with style and ease.', NULL, NULL, NULL, NULL, NULL, NULL, 214, 10, 'default|en|214|10'),
