(3054, 'en', 'default', 'Dress your little princess in our Pure Blossom Girls\' Sleeveless White Cotton Printed Kurti. The elegant white color and delicate print make it a classy choice. Crafted from soft and breathable cotton fabric, this sleeveless kurti ensures comfort and style for casual outings and everyday fashion.', NULL, NULL, NULL, NULL, NULL, NULL, 233, 9, 'default|en|233|9'),
(3055, 'en', 'default', 'Introducing the Pure Blossom Girls\' Sleeveless White Cotton Printed Kurti, a perfect blend of elegance and comfort for your little fashionista. The pristine white color of this kurti brings a fresh and classy appeal to any outfit.\r\n\r\nThe sleeveless design ensures comfort and breathability, making it perfect for casual outings and everyday wear. The delicate and tasteful print adds a stylish touch to the kurti, allowing your little one to showcase her unique style.\r\n\r\nCrafted from 100% soft and breathable cotton fabric, this kurti offers a gentle and cozy feel against your child\'s skin, making it ideal for all-day wear. The kurti is versatile and can be paired with leggings, jeans, or skirts for a variety of stylish looks.\r\n\r\nLet your little princess radiate charm and grace in the Pure Blossom Girls\' Sleeveless White Cotton Printed Kurti. It\'s the perfect addition to her wardrobe for adding a touch of elegance to her everyday fashion. Watch her shine in this beautifully designed kurti, making a statement with simplicity and style.', NULL, NULL, NULL, NULL, NULL, NULL, 233, 10, 'default|en|233|10'),
