(3112, 'en', 'default', 'Let your little girl shine in our Sunshine Glow Yellow Knee-Length Dress. This bright and cheerful dress is perfect for playtime and special occasions. The comfortable material and knee-length design ensure ease of movement, making it a must-have for every little girl\'s wardrobe.', NULL, NULL, NULL, NULL, NULL, NULL, 242, 9, 'default|en|242|9'),
(3113, 'en', 'default', 'Introducing the Sunshine Glow Yellow Knee-Length Dress for Little Girls, a delightful piece that radiates vibrancy and cheerfulness. The bright yellow color of this dress adds a touch of sunshine to your little one\'s wardrobe.\r\n\r\nThe knee-length design allows for ease of movement and play, ensuring that your little girl can comfortably run, jump, and explore. The A-line silhouette gives the dress a playful and cute appearance, perfect for your little one\'s playful spirit.\r\n\r\nCrafted from a soft and breathable cotton blend, this dress is comfortable for all-day wear, making it suitable for both special occasions and everyday play. The dress is lined with cotton to ensure a gentle feel against your child\'s skin.\r\n\r\nWhether it\'s a family gathering, a day at the park, or a birthday party, the Sunshine Glow Yellow Knee-Length Dress is a versatile choice that can be dressed up or down to suit the occasion. Let your little girl shine and spread happiness wherever she goes with this lovely dress.', NULL, NULL, NULL, NULL, NULL, NULL, 242, 10, 'default|en|242|10'),
