(3395, 'en', 'default', 'Dress your little princess in our Elegant Blush Girls\' Pink Frock. The subtle pink color and delicate embellishments make it a perfect choice for formal and semi-formal occasions. Crafted from soft and comfortable fabric, this knee-length frock offers both elegance and comfort.', NULL, NULL, NULL, NULL, NULL, NULL, 266, 9, 'default|en|266|9'),
(3396, 'en', 'default', 'Introducing the Elegant Blush Girls\' Pink Frock, a piece that embodies grace and sophistication for your little one. The soft and subtle pink color of this frock is perfect for adding a touch of elegance to any occasion.\r\n\r\nThe knee-length design offers versatility and style, making it suitable for various formal and semi-formal events. The delicate embellishments on the frock add a touch of grace and enhance its overall charm.\r\n\r\nCrafted from a soft and comfortable polyester blend, this frock ensures a gentle and cozy feel against your child\'s skin, making it ideal for all-day wear. The cotton lining adds to the comfort and ensures breathability.\r\n\r\nLet your little princess shine like a star in this Elegant Blush Girls\' Pink Frock. It\'s the perfect addition to her wardrobe for those special events and gatherings. Watch her twirl and dazzle in this beautifully designed frock, making every moment memorable and elegant.', NULL, NULL, NULL, NULL, NULL, NULL, 266, 10, 'default|en|266|10'),
