(3521, 'en', 'default', 'Dress your little princess in our Starry Night Girls\' Blue Party Wear Dress and let her shine like the starry night. This beautiful blue dress is designed for special occasions, featuring delicate embellishments for a touch of elegance. Crafted from comfortable and breathable material, it\'s perfect for making a statement at any party.', NULL, NULL, NULL, NULL, NULL, NULL, 277, 9, 'default|en|277|9'),
(3522, 'en', 'default', 'Introducing the Starry Night Girls\' Blue Party Wear Dress, a stunning piece that will make your little princess the star of the night. This beautiful blue dress is crafted for special occasions, ensuring that your child looks her best and feels like a princess.\r\n\r\nThe dress boasts a beautiful blue color that is both vibrant and eye-catching. The delicate embellishments on the dress add a touch of elegance and make it perfect for parties, weddings, or any other special event.\r\n\r\nCrafted from a comfortable and breathable polyester blend, this dress ensures that your little one remains at ease and can enjoy the event without any discomfort. The A-line silhouette gives the dress a graceful and stylish appearance, making your princess look even more charming.\r\n\r\nLet your little one shine like the starry night in this lovely dress. The Starry Night Girls\' Blue Party Wear Dress is perfect for creating memorable moments and ensuring that your child steals the show at any party. Let her twirl and dance the night away in this beautiful and stylish dress.', NULL, NULL, NULL, NULL, NULL, NULL, 277, 10, 'default|en|277|10'),
