(3570, 'en', 'default', 'Dress your little one in our Pretty in Pink Kids\' Cotton Dress, designed for 3-4-year-old kids. This adorable pink dress is perfect for adding a charming and playful touch to your child\'s look. Crafted from comfortable and breathable cotton fabric, it\'s suitable for various occasions and ensures all-day comfort.', NULL, NULL, NULL, NULL, NULL, NULL, 282, 9, 'default|en|282|9'),
