(3686, 'en', 'default', 'Introducing our WaveRider Boys\' Half Sleeve Blue Full Graphic Printed T-Shirt Pack. This pack includes three vibrant t-shirts with vivid and dynamic full graphic prints. Crafted from a comfortable cotton blend, these t-shirts are perfect for adding a bold and trendy element to your little boy\'s casual look.', NULL, NULL, NULL, NULL, NULL, NULL, 291, 9, 'default|en|291|9'),
(3687, 'en', 'default', 'Elevate your little boy\'s style with our WaveRider Boys\' Half Sleeve Blue Full Graphic Printed T-Shirt Pack. This pack features three vibrant t-shirts, each adorned with vivid and dynamic full graphic prints.\r\n\r\nThe half sleeve design of these t-shirts ensures a casual and trendy look, perfect for everyday wear. The full graphic prints add a bold and eye-catching element, making these t-shirts stand out in style.\r\n\r\nCrafted from a comfortable and breathable cotton blend, these t-shirts provide the comfort your child needs for all-day wear. Whether it\'s a day at school, a casual outing with friends, or a weekend adventure, these t-shirts are versatile and suitable for various casual occasions.\r\n\r\nMix and match these t-shirts with different bottoms to create a variety of stylish outfits. Let your little boy ride the waves of fashion with our WaveRider Boys\' Half Sleeve Blue Full Graphic Printed T-Shirt Pack, designed to bring excitement and vibrancy to his wardrobe.', NULL, NULL, NULL, NULL, NULL, NULL, 291, 10, 'default|en|291|10'),
