(4379, 'en', 'default', 'Unleash your inner musician and learn to play the guitar with our beginner-friendly guide, \"Learn to Play Guitar: A Step-by-Step Guide for Beginners\". This comprehensive resource provides easy-to-follow lessons, clear explanations, interactive exercises, and practice songs to help you master the fundamentals of guitar playing.', NULL, NULL, NULL, NULL, NULL, NULL, 354, 9, 'default|en|354|9'),
