(4549, 'en', 'default', 'Elevate your style with our Azure Sculpted Slim Fit Women\'s Jeans. Designed to flatter, these jeans offer a slim fit silhouette, combining high-quality denim with a modern design. Perfect for both casual outings and semi-formal occasions, these jeans provide the comfort and style you need.', NULL, NULL, NULL, NULL, NULL, NULL, 364, 9, 'default|en|364|9'),
(4550, 'en', 'default', 'Introducing Azure Sculpted Slim Fit Women\'s Jeans, the perfect blend of fashion and comfort. Crafted from a high-quality cotton blend with a touch of elastane for added stretch, these jeans offer a flattering slim fit, enhancing your natural curves and providing a sleek silhouette.\r\n\r\nThe classic five-pocket styling ensures convenience, allowing you to carry your essentials with ease. The button and zipper closure provide a secure fit, ensuring these jeans stay in place throughout your day.\r\n\r\nWhether you\'re dressing up for a night out or going for a casual look, the Azure Sculpted Slim Fit Women\'s Jeans are versatile and stylish, making them a wardrobe essential. Embrace the modern design and impeccable fit, and make a statement wherever you go.\r\n\r\nExperience the confidence that comes with wearing well-fitted jeans that are both comfortable and fashionable. Elevate your style, embrace your individuality, and step out in the Azure Sculpted Slim Fit Women\'s Jeans - a timeless addition to your wardrobe.', NULL, NULL, NULL, NULL, NULL, NULL, 364, 10, 'default|en|364|10'),
