(4730, 'en', 'default', 'Elevate your style with our Azure Sculpted Slim Fit Men\'s Jeans. These jeans offer a modern slim fit silhouette, combining high-quality denim with a comfortable and secure button-zipper closure. Versatile and suitable for various occasions, they are a must-have for any fashion-conscious man.', NULL, NULL, NULL, NULL, NULL, NULL, 380, 9, 'default|en|380|9'),
(4731, 'en', 'default', 'Introducing Azure Sculpted Slim Fit Men\'s Jeans, a perfect blend of fashion and comfort. Crafted from a high-quality cotton-elastane blend, these jeans offer a flattering slim fit, enhancing your natural silhouette and providing a sleek and modern appearance.\r\n\r\nThe classic five-pocket styling ensures convenience, allowing you to carry your essentials with ease. The button and zipper closure provide a secure fit, ensuring these jeans stay in place throughout your day.\r\n\r\nWhether you\'re dressing up for a night out or going for a casual look, the Azure Sculpted Slim Fit Men\'s Jeans are versatile and stylish, making them a wardrobe essential. Embrace the modern design and impeccable fit, and make a statement wherever you go.\r\n\r\nExperience the confidence that comes with wearing well-fitted jeans that are both comfortable and fashionable. Elevate your style, embrace your individuality, and step out in the Azure Sculpted Slim Fit Men\'s Jeans - a timeless addition to your wardrobe.', NULL, NULL, NULL, NULL, NULL, NULL, 380, 10, 'default|en|380|10'),
