(4757, 'en', 'default', 'Step up your sporty style with our Pure Elegance Women\'s White Stylish Sport Shoes. These shoes feature a clean and chic white design that complements your active lifestyle. They provide comfort, support, and durability for various physical activities, and the lace-up closure ensures a secure fit.', NULL, NULL, NULL, NULL, NULL, NULL, 386, 9, 'default|en|386|9'),
(4758, 'en', 'default', 'Introducing our Pure Elegance Women\'s White Stylish Sport Shoes, the perfect blend of chic style and sporty functionality. These shoes offer a clean and stylish white design that complements your active lifestyle, making them a versatile choice for various physical activities.\r\n\r\nThe comfort and support provided by these sport shoes ensure that you can move confidently and without restrictions. Whether you\'re hitting the gym, going for a jog, or simply strolling around, these shoes are designed to keep up with your pace.\r\n\r\nCrafted from durable and high-quality synthetic leather and mesh, these sport shoes are built to last. The lace-up closure allows for a secure and adjustable fit, ensuring that they stay snugly on your feet during any activity.\r\n\r\nElevate your sporty look with Pure Elegance Women\'s White Stylish Sport Shoes. They\'re more than just shoes; they\'re a reflection of your active and stylish lifestyle. Step into these sporty companions and embrace a world of comfort, durability, and fashion-forward design.', NULL, NULL, NULL, NULL, NULL, NULL, 386, 10, 'default|en|386|10'),
