(5981, 'en', 'default', 'Elevate your sporty and fashion-forward style with ChromaStride Men\'s Stylish Designer Multicolor Sports/Running Shoes. These vibrant and stylish shoes are designed to make a bold statement. Ideal for running and active lifestyles, they offer cushioned support, high-quality materials, and a secure fit with a lace-up closure.', NULL, NULL, NULL, NULL, NULL, NULL, 490, 9, 'default|en|490|9'),
(5982, 'en', 'default', 'Introducing our ChromaStride Men\'s Stylish Designer Multicolor Sports/Running Shoes, a pair of shoes that blend style, vibrancy, and functionality seamlessly.\r\n\r\nThese multicolor sports/running shoes are not just ordinary; they are designed to make a bold fashion statement. The vibrant colors and designer elements of these shoes add a touch of fashion-forward thinking to your active lifestyle. Whether you\'re going for a run or simply want to show off your unique style, these shoes are the perfect choice.\r\n\r\nThe cushioned support provided by these shoes ensures comfort during your runs and active pursuits. The high-quality synthetic leather and mesh construction guarantees durability and long-lasting performance.\r\n\r\nThe lace-up closure allows for a secure and adjustable fit, giving you control over the snugness of the shoes to match your comfort level.\r\n\r\nElevate your sporty and fashion-forward style with ChromaStride Men\'s Stylish Designer Multicolor Sports/Running Shoes. These shoes are more than just footwear; they are an expression of your vibrant and bold personality. Step into these multicolor and stylish shoes and let your unique style shine in the world of sports and fashion.', NULL, NULL, NULL, NULL, NULL, NULL, 490, 10, 'default|en|490|10'),
