(6474, 'en', 'default', 'Step into style and comfort with OceanBreeze Girls\' Blue Comfort Sneakers. These trendy blue sneakers are designed for fashion-forward young girls. Lightweight and cushioned, they provide all-day comfort, making them perfect for various activities. Crafted from breathable materials, they ensure fresh and active feet, while the non-slip sole guarantees safety during play and adventures.', NULL, NULL, NULL, NULL, NULL, NULL, 533, 9, 'default|en|533|9'),
(6475, 'en', 'default', 'OceanBreeze Girls\' Blue Comfort Sneakers are the perfect footwear for young girls who want to step into the world with both style and comfort.\r\n\r\nThese sneakers are designed to make a fashion statement. The trendy blue design adds a splash of style to any outfit, making them ideal for fashion-forward young girls who want to express their personality through their footwear.\r\n\r\nComfort is a priority, and these sneakers deliver. They are lightweight and cushioned, ensuring that your girl\'s feet stay comfortable all day long, whether she\'s at school, hanging out with friends, or embarking on adventures.\r\n\r\nThe materials used in these sneakers are breathable, keeping her feet feeling fresh and active, even during extended wear. This feature is especially important for active girls, as it prevents discomfort from perspiration.\r\n\r\nSafety is also a key consideration, with a non-slip sole that provides added stability during various activities. This ensures that she can move confidently without worrying about slipping.\r\n\r\nStep into style and comfort with OceanBreeze Girls\' Blue Comfort Sneakers. These sneakers are more than just footwear; they are a reflection of your girl\'s style and personality. Let her embrace her sense of fashion and comfort as she navigates through her day with confidence and flair.', NULL, NULL, NULL, NULL, NULL, NULL, 533, 10, 'default|en|533|10'),
