(6608, 'en', 'default', 'Elevate your cinematic journey with the CineXperience Monthly Movie Pass at $99 per month. Immerse yourself in the magic of 10 movies each month without extra charges. Valid nationwide with no blackout dates, this pass offers exclusive perks and concession discounts, making it a must-have for movie enthusiasts.', NULL, NULL, NULL, NULL, NULL, NULL, 545, 9, 'default|en|545|9'),
(6609, 'en', 'default', 'Introducing the CineXperience Monthly Movie Pass, designed for true movie enthusiasts who crave a consistent dose of cinematic joy. Priced at $99 per month, this pass lets you enjoy the magic of 10 movies each month without any additional charges.\r\n\r\nWith access to participating theaters nationwide and no blackout dates or restrictions, the CineXperience Monthly Movie Pass is your key to a cinematic adventure that knows no bounds. Whether you\'re a film buff or someone who loves regular movie nights, this pass caters to your passion.\r\n\r\nAs a pass holder, you not only get the thrill of unlimited movies but also exclusive perks and discounts on concessions. Enhance your movie-going experience with easy online booking and seat selection, ensuring you make the most of every screening.\r\n\r\nFor those who consider the cinema a second home, the CineXperience Monthly Movie Pass is a ticket to a month filled with stories, laughter, and awe-inspiring moments on the big screen. Treat yourself or gift the ultimate cinematic experience to someone special. Don\'t miss out on the joy  subscribe to CineXperience Monthly Movie Pass and let the movies come to life!', NULL, NULL, NULL, NULL, NULL, NULL, 545, 10, 'default|en|545|10'),
