(6668, NULL, NULL, '<p>Book your next event at the <strong>Classic Community Hall</strong>, a spacious, versatile venue perfect for parties, meetings, celebrations, and more. Convenient, affordable, and easy to book, it offers everything you need for a successful event.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 548, 9, '548|9'),
(6669, NULL, NULL, '<p>Looking for a spacious and reliable venue for your next event? The <strong>Classic Community Hall</strong> offers the perfect setting for a wide range of occasions, from birthday parties and weddings to business meetings and community events. With its flexible layout, ample seating, and convenient location, this hall is ideal for gatherings of all sizes.</p>\n<p>The hall is equipped with essential amenities, including audio-visual equipment, catering facilities, and accessible parking, ensuring that your event runs smoothly from start to finish. Whether you\'re hosting a formal event or a casual gathering, the <strong>Classic Community Hall</strong> provides a comfortable and welcoming atmosphere for every occasion.</p>\n<p></p>', NULL, NULL, NULL, NULL, NULL, NULL, 548, 10, '548|10'),
