(6708, NULL, NULL, '<p>Book your <strong>Doctor Care Appointment</strong> with ease. Our quick and convenient online service allows you to schedule consultations with trusted medical professionals for your health needs, all from the comfort of your home.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 550, 9, '550|9'),
(6709, NULL, NULL, '<p>Take control of your health with the <strong>Doctor Care Appointment</strong> service, designed to offer fast and convenient access to medical consultations. Whether you need a routine check-up, advice on a specific condition, or simply have health questions, our platform allows you to easily book an appointment with experienced healthcare professionals.</p>\n<p>With a user-friendly interface, you can select a time that works best for you, without the long wait times typically associated with traditional doctor visits. Our doctors are dedicated to providing personalized care and professional guidance, ensuring you feel confident in your healthcare decisions.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 550, 10, '550|10'),
