(7044, NULL, NULL, '<p>Experience the perfect blend of portability and performance with this 8-inch compact tablet. Designed for everyday tasks, it features a bright and responsive HD touchscreen, making it ideal for reading eBooks, watching videos, or browsing the web. With 32GB of built-in storage (expandable up to 128GB via microSD), there\'s plenty of space for apps and media. The tablet runs on a lightweight operating system, ensuring smooth performance and easy navigation. Built-in Wi-Fi, a front-facing camera for video calls, and an all-day battery make it a reliable companion for home, travel, or school.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 567, 10, '567|10'),
