(7360, NULL, NULL, '<p>Stay effortlessly stylish with our <strong>Denim Dreamer Jacket</strong>. Durable, comfortable, and versatile, its perfect for casual outings, layering, or adding a chic touch to any outfit.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 587, 9, '587|9'),
(7361, NULL, NULL, '<p>Elevate your casual wardrobe with the <strong>Denim Dreamer Jacket</strong>, a timeless piece designed for style, comfort, and durability. Made from high-quality denim, this jacket offers a perfect balance of structure and flexibility, making it ideal for layering over your favorite tops or dresses.</p>\n<p>Its classic design features a button-up front, functional pockets, and a flattering cut that complements all body types. Whether youre heading out for a casual day with friends, running errands, or enjoying an evening out, the <strong>Denim Dreamer Jacket</strong> adds a touch of effortless style to any outfit. Soft yet durable, its built to withstand daily wear while keeping you looking chic and confident.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 587, 10, '587|10'),
