(7576, NULL, NULL, '<p>Shine bright in our <strong>Cute Sparkle Frock</strong>! This dress combines fun, elegance, and a touch of glamour with its sparkling fabric and playful design. Perfect for parties, celebrations, or any special occasion.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 596, 9, '596|9'),
(7577, NULL, NULL, '<p>Add a touch of sparkle to your little ones wardrobe with our <strong>Cute Sparkle Frock</strong>, designed for moments when only the best will do. The dress features a beautifully crafted fabric with just the right amount of shimmer, making it perfect for birthday parties, family celebrations, or any special event where your child deserves to stand out.</p>\n<p>The frock has a flattering fit thats both comfortable and stylish, with delicate details like soft gathers and a flattering A-line shape. Its made from soft, breathable material, ensuring your child feels as good as they look. The vibrant sparkle effect brings an extra layer of charm, ensuring your little one shines in every room they enter.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 596, 10, '596|10'),
