(7600, NULL, NULL, '<p>The <strong>Little Champ Jacket</strong> is perfect for keeping your little one warm and stylish. Made with soft, durable fabric, this jacket provides comfort and protection during colder days while adding a sporty touch to their wardrobe.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 597, 9, '597|9'),
(7601, NULL, NULL, '<p>Gear up your little champ with the <strong>Little Champ Jacket</strong>, designed to keep them cozy, warm, and looking cool. Made from high-quality, soft fabric, this jacket provides just the right amount of warmth for those chilly mornings or cooler afternoons. The sporty design, with a zip-up front, ribbed cuffs, and a sleek collar, offers both style and function for everyday wear.</p>\n<p>Whether they\'re heading to school, going on an adventure, or enjoying a day at the park, the <strong>Little Champ Jacket</strong> provides comfort and durability for active kids. The jacket is available in a variety of fun colors, making it easy to mix and match with their favorite outfits.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 597, 10, '597|10'),
