(7624, NULL, NULL, '<p>Stay chic and cozy with the <strong>Mini Fashion Jacket</strong>. This trendy jacket combines style and comfort with a perfect fit, making it a must-have addition to your wardrobe for any casual outing or night on the town.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 598, 9, '598|9'),
(7625, NULL, NULL, '<p>Add a touch of flair to your everyday look with the <strong>Mini Fashion Jacket</strong>, a versatile piece designed to keep you looking stylish and feeling comfortable. Crafted with soft, high-quality fabric, this jacket offers just the right amount of warmth without being bulky, making it ideal for layering during cooler months or wearing on its own for a chic, casual look.</p>\n<p>The <strong>Mini Fashion Jacket</strong> features a sleek, tailored fit that enhances your figure, with stylish details like a zip-up front, adjustable cuffs, and a modern collar. Whether you\'re heading out with friends, running errands, or enjoying a weekend getaway, this jacket adds a fashionable twist to any outfit.</p>\n<p>Pair it with jeans, dresses, or skirts to create a wide range of looks, and enjoy its perfect balance of comfort, versatility, and timeless style.</p>', NULL, NULL, NULL, NULL, NULL, NULL, 598, 10, '598|10'),
