(47, 'CTPSS2023', 'configurable', '', 'Blossom Breeze Cotton Printed Short Skirt', 'Embrace the playful elegance of our Blossom Breeze Cotton Printed Short Skirt. Crafted from high-quality cotton fabric and adorned with a delightful print, this skirt is perfect for those seeking a blend of comfort and style in their summer wardrobe.', 'Introducing the Blossom Breeze Cotton Printed Short Skirt, a charming addition to your summer wardrobe. Made from premium quality cotton, this skirt offers a soft and breathable feel, ensuring comfort all day long. The delightful print features blossoms and intricate patterns, adding a touch of playfulness to your ensemble.\r\n\r\nThe A-line silhouette of the Blossom Breeze skirt is designed to provide a flattering fit, accentuating your curves in all the right ways. The length is just perfect, offering a balance between style and ease of movement, making it ideal for casual outings, picnics, or a day at the beach.\r\n\r\nPair this skirt with a simple tank top or a cropped blouse to complete the look. Add sandals and minimal accessories for a laid-back summer vibe or dress it up with wedges and statement jewelry for a more elevated appearance. The Blossom Breeze Cotton Printed Short Skirt is a versatile piece that effortlessly adapts to your style and the occasion.\r\n\r\nExperience the epitome of summer fashion with our Blossom Breeze Cotton Printed Short Skirt. Let the vibrant print and comfortable fabric make a statement as you embrace the sun-kissed season with confidence and style.', 'blossom-breeze-cotton-printed-short-skirt', 1, 1, 1, 'Blossom Breeze Cotton Printed Short Skirt', '', 'Experience the epitome of summer fashion with our Blossom Breeze Cotton Printed Short Skirt. Let the vibrant print and comfortable fabric make a statement as you embrace the sun-kissed season with confidence and style.', NULL, NULL, NULL, NULL, NULL, '2023-11-07 18:42:36', 'en', 'default', 8, 47, '2023-11-07 18:49:10', NULL, 1),
(48, 'CTPSS2023-variant-16', 'simple', NULL, 'Blossom Breeze Cotton Printed Short Skirt-24', 'CTPSS2023-variant-16', 'CTPSS2023-variant-16', 'CTPSS2023-variant-16', NULL, NULL, 1, NULL, NULL, NULL, 24.9900, NULL, NULL, NULL, 4.0000, '2023-11-07 18:42:36', 'en', 'default', 8, 48, '2025-08-18 20:22:28', 47, NULL),
