(51, 'ORSAREE2023', 'configurable', '', 'Radiant Tangerine Sunset Saree', 'Drape yourself in the hues of a captivating sunset with our Radiant Tangerine Sunset Saree. This vibrant orange saree exudes grace and elegance, perfect for any occasion that demands a touch of traditional splendor.', 'Discover the allure of our Radiant Tangerine Sunset Saree, a masterpiece in orange. This stunning saree is an epitome of elegance, designed to make you stand out at every event. The vibrant tangerine shade reminiscent of a breathtaking sunset complements all skin tones, making it an ideal choice for women who love a touch of vibrancy in their attire.\r\n\r\nCrafted from high-quality fabric, this saree drapes beautifully and offers unparalleled comfort. The intricate design and delicate border add a touch of sophistication, enhancing the overall aesthetic. The ensemble includes a matching blouse piece, allowing you to tailor it to your style and fit.\r\n\r\nWhether it\'s a festive celebration, a wedding, or a special gathering, the Radiant Tangerine Sunset Saree is your go-to option. Pair it with statement jewelry and minimalistic makeup to complete the look. This saree promises to make you the center of attention and evoke a sense of timeless beauty.\r\n\r\nEmbrace the beauty of tradition with the Radiant Tangerine Sunset Saree. Let its vibrant hue and graceful draping bring out the elegance in you, leaving a lasting impression wherever you go. Experience the magic of this saree and be ready to captivate hearts with every stride.', 'radiant-tangerine-sunset-saree', 1, 1, 1, 'Radiant Tangerine Sunset Saree', '', 'Embrace the beauty of tradition with the Radiant Tangerine Sunset Saree. Let its vibrant hue and graceful draping bring out the elegance in you, leaving a lasting impression wherever you go. Experience the magic of this saree and be ready to captivate hearts with every stride.', NULL, NULL, NULL, NULL, NULL, '2023-11-07 18:55:46', 'en', 'default', 1, 51, '2023-11-07 19:01:54', NULL, 1),
