(64, 'ELEGANCEBLOOMHEELS', 'configurable', '', 'Elegance in Bloom Women\'s Black Floral Heels with Stylish Bow', 'Step into elegance with our Elegance in Bloom Women\'s Black Floral Heels, featuring a stunning black floral pattern and a stylish bow detail. These heels are not only beautiful but also comfortable, making them perfect for various formal occasions. The secure buckle closure ensures a snug fit.', 'Introducing our Elegance in Bloom Women\'s Black Floral Heels with a Stylish Bow, the perfect footwear to elevate your style and add a touch of sophistication to your ensemble.\r\n\r\nThe exquisite black floral pattern on these heels is a visual delight, giving your look a sense of elegance and charm. The stylish bow detail adds an extra layer of sophistication, making these heels suitable for various formal occasions, from weddings to cocktail parties.\r\n\r\nCrafted with sturdy and comfortable heels, these shoes are designed for all-day wear, allowing you to dance the night away without discomfort. The secure and adjustable buckle closure ensures a snug and secure fit, so you can walk with confidence.\r\n\r\nElevate your style and add a touch of elegance to your every step with our Elegance in Bloom Women\'s Black Floral Heels. These heels are not just shoes; they are a statement of your refined taste and style. Step into these stunning heels, and let the world see your beauty and grace.', 'elegance-in-bloom-womens-black-floral-heels-with-stylish-bow', 1, 1, 1, 'Elegance in Bloom Women\'s Black Floral Heels with Stylish Bow', '', 'Step into elegance with our Elegance in Bloom Women\'s Black Floral Heels, featuring a stunning black floral pattern and a stylish bow detail. These heels are not only beautiful but also comfortable, making them perfect for various formal occasions. The secure buckle closure ensures a snug fit.', NULL, NULL, NULL, NULL, NULL, '2023-11-09 10:11:00', 'en', 'default', 14, 64, '2023-11-09 10:14:38', NULL, 1),
