(75, 'YOUNGTRENDSETTERBOYS2023', 'configurable', '', 'Young Trendsetter Boys\' Designer and Fashionable Running Shoes', 'Empower the trendsetters of tomorrow with Young Trendsetter Boys\' Designer and Fashionable Running Shoes. These stylish and designer shoes are perfect for young individuals who want to make a fashion statement while staying active. Designed for sports, active pursuits, and everyday adventures, they offer comfort, durability, and a secure fit with a lace-up closure.', 'Introducing our Young Trendsetter Boys\' Designer and Fashionable Running Shoes, a pair of footwear designed for the young fashion-forward individuals who are always on the move.\r\n\r\nThese running shoes are not your average pair; they are a fashion statement in themselves. Designed with a stylish and trendsetting look, they empower young boys to express their unique style while enjoying their active pursuits. Whether it\'s sports, running, or everyday adventures, these shoes are made to match the energy and style of young trendsetters.\r\n\r\nComfort is key, and these shoes ensure that young boys can stay active for hours without discomfort. The high-quality synthetic leather and mesh materials guarantee that these shoes withstand the wear and tear of active and adventurous young lives.\r\n\r\nThe lace-up closure not only provides a secure fit but also allows for adjustability, so young individuals can customize the fit to their liking.\r\n\r\nEmpower the trendsetters of tomorrow with Young Trendsetter Boys\' Designer and Fashionable Running Shoes. These shoes are more than just footwear; they are a reflection of individuality, style, and the desire to stand out in the crowd. Let the young trendsetters make a fashion statement with each step they take, embracing both fashion and an active lifestyle.', 'young-trendsetter-boys-designer-and-fashionable-running-shoes', 1, 1, 1, 'Young Trendsetter Boys\' Designer and Fashionable Running Shoes', '', 'Empower the trendsetters of tomorrow with Young Trendsetter Boys\' Designer and Fashionable Running Shoes. These stylish and designer shoes are perfect for young individuals who want to make a fashion statement while staying active.', NULL, NULL, NULL, NULL, NULL, '2023-11-09 10:24:56', 'en', 'default', 9, 75, '2023-11-09 10:30:35', NULL, 1),
