(141, 'VIBRANTTRIO-TSPACK2023', 'configurable', '', 'Vibrant Trio Boys\' Half Sleeve T-Shirt Pack', 'Introducing our Vibrant Trio Boys\' Half Sleeve T-Shirt Pack, featuring three lively t-shirts in red, yellow, and green. These t-shirts are designed with eye-catching prints and a comfortable half sleeve design, perfect for adding style to your little boy\'s everyday look.', 'Elevate your little boy\'s wardrobe with our Vibrant Trio Boys\' Half Sleeve T-Shirt Pack, a delightful ensemble featuring three lively t-shirts in bold and energetic colors: red, yellow, and green.\r\n\r\nThe half sleeve design of these t-shirts ensures a casual and trendy look, perfect for everyday wear. Whether it\'s a day at school, a casual outing, or a playdate with friends, these t-shirts are versatile and suitable for various casual occasions.\r\n\r\nThe eye-catching prints on each t-shirt add a touch of style and make these shirts stand out. The vibrant colors and playful designs are sure to capture attention and make your little one look absolutely charming.\r\n\r\nCrafted from a comfortable and breathable cotton blend, these t-shirts are gentle on your child\'s skin and provide the comfort needed for all-day wear. Let your little boy showcase his vibrant personality in these lively t-shirts, designed to bring color and joy to his everyday adventures.', 'vibrant-trio-boys-half-sleeve-t-shirt-pack', 1, 1, 1, 'Vibrant Trio Boys\' Half Sleeve T-Shirt Pack', '', 'Introducing our Vibrant Trio Boys\' Half Sleeve T-Shirt Pack, featuring three lively t-shirts in red, yellow, and green. These t-shirts are designed with eye-catching prints and a comfortable half sleeve design, perfect for adding style to your little boy\'s everyday look.', NULL, NULL, NULL, NULL, NULL, '2023-11-09 11:30:23', 'en', 'default', 10, 141, '2023-11-09 11:36:38', NULL, 1),
