(151, 'CITRUSBLOOMTEE2023', 'configurable', '', 'Citrus Bloom Girls\' Orange Printed T-Shirt', 'Brighten up your little girl\'s wardrobe with our Citrus Bloom Girls\' Orange Printed T-Shirt. The vibrant orange color and playful print make it a lively choice. Crafted from comfortable fabric, this tee is perfect for everyday wear and casual outings, adding a touch of fun and style to her look.', 'Introducing the Citrus Bloom Girls\' Orange Printed T-Shirt, a burst of energy and style for your little fashionista. The vibrant orange color of this tee is sure to grab attention and bring a lively vibe to any outfit.\r\n\r\nThe playful print on the shirt adds a touch of whimsy and fun, making it suitable for casual outings, playdates, or any occasion where a dash of cheerfulness is needed.\r\n\r\nCrafted from a comfortable and soft cotton blend, this t-shirt ensures a cozy and gentle feel against your child\'s skin, making it ideal for everyday wear. The short sleeves and casual design make it perfect for those sunny days when comfort and style are a priority.\r\n\r\nLet your little one showcase her vibrant personality with the Citrus Bloom Girls\' Orange Printed T-Shirt. It\'s the perfect addition to her wardrobe, adding a pop of color and style to her everyday look. Watch her light up the room with this lively and playful t-shirt.', 'citrus-bloom-girls-orange-printed-t-shirt', 1, 1, 1, 'Citrus Bloom Girls\' Orange Printed T-Shirt', '', 'Brighten up your little girl\'s wardrobe with our Citrus Bloom Girls\' Orange Printed T-Shirt. The vibrant orange color and playful print make it a lively choice. Crafted from comfortable fabric, this tee is perfect for everyday wear and casual outings, adding a touch of fun and style to her look.', NULL, NULL, NULL, NULL, NULL, '2023-11-09 11:39:27', 'en', 'default', 10, 151, '2023-11-09 11:43:38', NULL, 1),
