(156, 'BYT-100', 'downloadable', '', 'Beginner Yoga Tutorial- 300+ HD digital video tutorials for everyday practice', 'Learn yoga basics and poses with our 300+ video tutorials for complete beginners. Yoga poses for everyday practice, Beginner Friendly\r\nMaterial: HD digital video', 'Get ready to learn yoga with our Beginner Yoga Tutorial! This comprehensive tutorial includes 300+ video tutorials for everyday practice. Perfect for those brand new to yoga, this tutorial teaches the basics of yoga in an easy-to-understand and beginner friendly format. Get ready to take your practice to the next level with our Beginner Yoga Tutorial!', 'beginner-yoga-tutorial--300-hd-digital-video-tutorials-for-everyday-practice', 1, 1, 1, 'Beginner Yoga Tutorial- 300+ HD digital video tutorials for everyday practice', '', 'Learn yoga basics and poses with our 300+ video tutorials for complete beginners. Yoga poses for everyday practice, Beginner Friendly\r\nMaterial: HD digital video', 48.9900, 45.9900, NULL, NULL, NULL, '2023-11-10 10:37:37', 'en', 'default', 15, 156, '2023-11-10 10:46:55', NULL, 1),
(161, 'COASTALBREEZEMENSHOODIE2023', 'simple', '', 'Coastal Breeze Men\'s Blue Zipper Hoodie-S', 'Stay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This fashionable hoodie features a modern design, making it ideal for casual and active wear. The soft and cozy interior lining provides warmth, while the full zipper closure allows for versatile styling and temperature control. Convenient front pockets are perfect for storage and keeping your hands warm.', 'The Coastal Breeze Men\'s Blue Zipper Hoodie is your reliable companion for staying warm, comfortable, and stylish.\r\n\r\nThis hoodie is designed for the modern man who values both fashion and functionality. The stylish blue design adds a touch of contemporary flair, making it suitable for various occasions, whether you\'re running errands, heading to the gym, or simply enjoying a relaxed day out.\r\n\r\nWarmth is a top priority, and this hoodie delivers. The interior lining is soft and cozy, ensuring that you stay comfortable and warm even in cooler weather. It\'s the perfect addition to your wardrobe when you need that extra layer of insulation.\r\n\r\nThe full zipper closure is not just about style; it allows you to control your comfort and temperature easily. You can wear the hoodie fully zipped for maximum warmth or open it up for a more relaxed look. This versatility makes it a go-to choice for various settings.\r\n\r\nConvenience is key, and the front pockets provide just that. They are perfect for storing your essentials, whether it\'s your phone, wallet, or keys. Plus, they keep your hands warm during chilly days.\r\n\r\nCrafted from a comfortable and durable cotton blend, this hoodie is designed to withstand everyday wear and maintain its stylish appeal.\r\n\r\nStay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This hoodie is more than just clothing; it\'s a reflection of your modern and practical fashion sense. Let it be your reliable choice for staying cozy and fashionable in any situation, ensuring you look and feel your best.', 'coastal-breeze-mens-blue-zipper-hoodie-s', 1, 1, 1, '', '', 'Stay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This fashionable hoodie features a modern design, making it ideal for casual and active wear. The soft and cozy interior lining provides warmth, while the full zipper closure allows for versatile styling and temperature control.', 52.9900, 50.9900, NULL, NULL, 4.0000, '2023-11-10 12:31:05', 'en', 'default', 2, 161, '2025-08-18 20:22:33', NULL, 0),
