st Winter Accessories Bundle is a versatile choice. Delight someone special during the holiday season or elevate your own winter wardrobe with this stylish and functional ensemble. Embrace the frost with confidence, knowing that you have the perfect accessories to keep you warm and chic.', 'arctic-frost-winter-accessories-bundle', 1, 1, 1, 'Arctic Frost Winter Accessories Bundle', '', 'Elevate your fashion game with our All-in-One Smart Casual Outfit Set. This complete look includes an open full sleeve smart jacket, a printed black t-shirt, blue denim jeans, and sneaker shoes. Crafted from high-quality materials, this set offers a coordinated and hassle-free fashion choice for various occasions, ensuring you look stylish and comfortable.', NULL, NULL, NULL, NULL, NULL, '2023-11-10 13:10:23', 'en', 'default', 17, 175, '2023-11-10 16:18:30', NULL, 1),
