d fashionable in any situation, ensuring you look and feel your best.', 'coastal-breeze-mens-blue-zipper-hoodie', 1, 1, 1, 'Coastal Breeze Men\'s Blue Zipper Hoodie', '', 'Stay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This fashionable hoodie features a modern design, making it ideal for casual and active wear. The soft and cozy interior lining provides warmth, while the full zipper closure allows for versatile styling and temperature control.', NULL, NULL, NULL, NULL, NULL, '2023-11-10 14:04:34', 'en', 'default', 2, 176, '2023-11-10 14:08:29', NULL, 1),
