(182, 'ARCTICBLISSSCARF2023', 'simple', '', 'Arctic Bliss Stylish Winter Scarf', 'Experience the embrace of warmth and style with our Arctic Bliss Winter Scarf. Crafted from a luxurious blend of acrylic and wool, this cozy scarf is designed to keep you snug during the coldest days. Its stylish and versatile design, combined with an extra-long length, offers customizable styling options. Elevate your winter wardrobe or delight someone special with this essential winter accessory.', 'The Arctic Bliss Winter Scarf is more than just a cold-weather accessory; it\'s a statement of warmth, comfort, and style for the winter season.\r\n\r\nCrafted with care from a luxurious blend of acrylic and wool, this scarf is designed to keep you cozy and snug even in the chilliest temperatures. The soft and plush texture not only provides insulation against the cold but also adds a touch of luxury to your winter wardrobe.\r\n\r\nThe design of the Arctic Bliss Winter Scarf is both stylish and versatile, making it a perfect addition to a variety of winter outfits. Whether you\'re dressing up for a special occasion or adding a chic layer to your everyday look, this scarf complements your style effortlessly.\r\n\r\nThe extra-long length of the scarf offers customizable styling options. Wrap it around for added warmth, drape it loosely for a casual look, or experiment with different knots to express your unique style. This versatility makes it a must-have accessory for the winter season.\r\n\r\nLooking for the perfect gift? The Arctic Bliss Winter Scarf is an ideal choice. Whether you\'re surprising a loved one or treating yourself, this scarf is a timeless and practical gift that will be cherished throughout the winter months.\r\n\r\nEmbrace the winter with the Arctic Bliss Winter Scarf, where warmth meets style in perfect harmony. Elevate your winter wardrobe with this essential accessory that not only keeps you warm but also adds a touch of sophistication to your cold-weather ensemble.', 'arctic-bliss-stylish-winter-scarf', 1, 1, 1, 'Arctic Bliss Winter Scarf', '', 'Experience the embrace of warmth and style with our Arctic Bliss Winter Scarf. Crafted from a luxurious blend of acrylic and wool, this cozy scarf is designed to keep you snug during the coldest days. Elevate your winter wardrobe or delight someone special with this essential winter accessory.', 25.9900, 24.9900, NULL, NULL, 2.0000, '2023-11-10 15:19:56', 'en', 'default', 20, 182, '2025-08-18 20:22:35', NULL, 1),
(183, 'ARCTICTOUCHGLOVES2023', 'simple', '', 'Arctic Touchscreen Winter Gloves', 'Stay connected and warm with our Arctic Touchscreen Winter Gloves. These gloves are not only crafted from high-quality acrylic for warmth and durability but also feature a touchscreen-compatible design. With an insulated lining, elastic cuffs for a secure fit, and a stylish look, these gloves are perfect for daily wear in chilly conditions.', 'Introducing the Arctic Touchscreen Winter Gloves  where warmth, style, and connectivity meet to enhance your winter experience.\r\n\r\nCrafted from high-quality acrylic, these gloves are designed to provide exceptional warmth and durability. The touchscreen-compatible fingertips allow you to stay connected without exposing your hands to the cold. Answer calls, send messages, and navigate your devices effortlessly, all while keeping your hands snug.\r\n\r\nThe insulated lining adds an extra layer of coziness, making these gloves your go-to choice for facing the winter chill. Whether you\'re commuting, running errands, or enjoying outdoor activities, these gloves provide the warmth and protection you need.\r\n\r\nElastic cuffs ensure a secure fit, preventing cold drafts and keeping the gloves in place during your daily activities. The stylish design adds a touch of flair to your winter ensemble, making these gloves as fashionable as they are functional.\r\n\r\nIdeal for gifting or as a treat for yourself, the Arctic Touchscreen Winter Gloves are a must-have accessory for the modern individual. Say goodbye to the inconvenience of removing your gloves to use your devices and embrace the seamless blend of warmth, style, and connectivity.\r\n\r\nStay connected, stay warm, and stay stylish with the Arctic Touchscreen Winter Gloves  your reliable companion for conquering the winter season with confidence.', 'arctic-touchscreen-winter-gloves', 1, 1, 1, 'Arctic Touchscreen Winter Gloves', '', 'Stay connected and warm with our Arctic Touchscreen Winter Gloves. These gloves are not only crafted from high-quality acrylic for warmth and durability but also feature a touchscreen-compatible design. With an insulated lining, elastic cuffs for a secure fit, and a stylish look, these gloves are perfect for daily wear in chilly conditions.', 29.9900, 27.9900, NULL, NULL, 2.0000, '2023-11-10 15:29:20', 'en', 'default', 20, 183, '2025-08-18 20:22:35', NULL, 1);
