(184, 'ARCTICCOZYBEANIE2023', 'simple', '', 'Arctic Cozy Knit Unisex Beanie', '<p>Embrace the chilly days in style with our Arctic Cozy Knit Beanie. Crafted from a soft and durable blend of acrylic, this classic beanie offers warmth and versatility. Suitable for both men and women, it\'s the ideal accessory for casual or outdoor wear. Elevate your winter wardrobe or gift someone special with this essential beanie cap.</p>', '<p>The Arctic Cozy Knit Beanie is your go-to solution for staying warm, comfortable, and stylish during the colder months. Crafted from a soft and durable blend of acrylic knit, this beanie is designed to provide a cozy and snug fit. The classic design makes it suitable for both men and women, offering a versatile accessory that complements various styles. Whether you\'re heading out for a casual day in town or embracing the great outdoors, this beanie adds a touch of comfort and warmth to your ensemble. The soft and breathable material ensures that you stay cozy without sacrificing style. The Arctic Cozy Knit Beanie isn\'t just an accessory; it\'s a statement of winter fashion. Its simplicity makes it easy to pair with different outfits, making it a staple in your winter wardrobe. Ideal for gifting or as a treat for yourself, this beanie is a thoughtful addition to any winter ensemble. It\'s a versatile accessory that goes beyond functionality, adding a touch of warmth and style to your look. Embrace the essence of winter with the Arctic Cozy Knit Beanie. Whether you\'re enjoying a casual day out or facing the elements, let this beanie be your companion for comfort and style. Elevate your winter wardrobe with this classic accessory that effortlessly combines warmth with a timeless sense of fashion.</p>', 'arctic-cozy-knit-unisex-beanie', 1, 1, 1, 'Arctic Cozy Knit Beanie', '', 'Embrace the chilly days in style with our Arctic Cozy Knit Beanie. Crafted from a soft and durable blend of acrylic, this classic beanie offers warmth and versatility. Suitable for both men and women, it\'s the ideal accessory for casual or outdoor wear. Elevate your winter wardrobe or gift someone special with this essential beanie cap.', 39.9800, NULL, NULL, NULL, 2.0000, '2023-11-10 15:48:08', 'en', 'default', 20, 184, '2025-11-12 11:33:08', NULL, 1),
(185, 'ARCTICWARMTHSOCKS2023', 'simple', '', 'Arctic Warmth Wool Blend Socks', 'Experience the unmatched warmth and comfort of our Arctic Warmth Wool Blend Socks. Crafted from a blend of Merino wool, acrylic, nylon, and spandex, these socks offer ultimate coziness for cold weather. With a reinforced heel and toe for durability, these versatile and stylish socks are perfect for various occasions.', 'Introducing the Arctic Warmth Wool Blend Socks  your essential companion for cozy and comfortable feet during the colder seasons.\r\n\r\nCrafted from a premium blend of Merino wool, acrylic, nylon, and spandex, these socks are designed to provide unparalleled warmth and comfort. The wool blend ensures that your feet stay toasty even in the coldest temperatures, making these socks the perfect choice for winter adventures or simply staying snug at home.\r\n\r\nThe soft and cozy texture of the socks offers a luxurious feel against your skin. Say goodbye to chilly feet as you embrace the plush warmth provided by these wool blend socks.\r\n\r\nDesigned for durability, the socks feature a reinforced heel and toe, adding extra strength to high-wear areas. This ensures that your socks withstand the test of time, providing long-lasting comfort and coziness.\r\n\r\nThe breathable nature of the material prevents overheating, allowing your feet to stay comfortable and dry throughout the day. Whether you\'re heading outdoors for a winter hike or relaxing indoors, these socks offer the perfect balance of warmth and breathability.\r\n\r\nVersatile and stylish, these wool blend socks are suitable for various occasions. Pair them with your favorite boots for a fashionable winter look or wear them around the house for ultimate comfort.\r\n\r\nElevate your winter wardrobe and prioritize comfort with the Arctic Warmth Wool Blend Socks. Treat your feet to the luxury they deserve and step into a world of coziness that lasts all season long.', 'arctic-warmth-wool-blend-socks', 1, 1, 1, 'Arctic Warmth Wool Blend Socks', '', 'Experience the unmatched warmth and comfort of our Arctic Warmth Wool Blend Socks. Crafted from a blend of Merino wool, acrylic, nylon, and spandex, these socks offer ultimate coziness for cold weather.', 18.9900, 17.9900, NULL, NULL, 2.0000, '2023-11-10 16:11:33', 'en', 'default', 20, 185, '2025-08-18 20:22:35', NULL, 1),
(186, 'CTPS2023', 'configurable', '', 'Comfort Breeze Cotton Printed Short Skirt', 'Experience the ultimate in comfort and style with our Comfort Breeze Cotton Printed Short Skirt. This delightful skirt combines the breathability of cotton with a trendy print, making it a must-have for your summer wardrobe.', 'Step into the season with our Comfort Breeze Cotton Printed Short Skirt, where comfort and fashion collide. Crafted from soft, breathable cotton, this skirt is designed to keep you cool and stylish on those warm days. The airy and lightweight fabric ensures all-day comfort, whether you\'re exploring the city, strolling on the beach, or enjoying a casual day out.\r\n\r\nThe playful print adds a touch of whimsy to your outfit, making it perfect for a laid-back and carefree look. The elastic waistband offers a secure fit and convenience, while the short length showcases your legs in an effortlessly chic manner.\r\n\r\nOur Comfort Breeze Cotton Printed Short Skirt is the ideal choice for embracing summer in style. Pair it with your favorite tank top, sandals, and sunglasses for an easygoing beachy vibe, or dress it up with a blouse and wedges for a night out with friends. Discover the joy of comfort and elegance with this versatile piece. Your summer wardrobe just found its perfect addition!', 'comfort-breeze-cotton-printed-short-skirt', 1, 1, 1, 'Comfort Breeze Cotton Printed Short Skirt', '', 'Experience the ultimate in comfort and style with our Comfort Breeze Cotton Printed Short Skirt. This delightful skirt combines the breathability of cotton with a trendy print, making it a must-have for your summer wardrobe.', NULL, NULL, NULL, NULL, NULL, '2023-11-10 16:24:02', 'en', 'default', 8, 186, '2023-11-10 16:26:28', NULL, 1),
