(197, 'BWLRUGJKT2023', 'configurable', '', 'Raven\'s Edge Women\'s Black Leather Jacket with Rugged Sleeves', 'Unleash your adventurous spirit with our Raven\'s Edge Women\'s Black Leather Jacket featuring rugged sleeves. Crafted from high-quality leather, this jacket exudes rugged charm and is a timeless addition to any wardrobe.', 'Introducing the Raven\'s Edge Women\'s Black Leather Jacket with Rugged Sleeves, a fusion of elegance and adventurous style. Made from genuine, premium-quality leather, this jacket is designed to make a bold fashion statement with a rugged touch.\r\n\r\nThe classic black color is intensified by the rugged sleeves, adding an element of toughness and uniqueness to this piece. The tailored fit complements your figure, providing a sleek and flattering silhouette.\r\n\r\nThis jacket features a classic asymmetrical zipper design and multiple pockets for both style and functionality. The buttery soft leather ensures a comfortable and luxurious wear, while the quilted detailing on the shoulders and sleeves adds a distinctive touch.\r\n\r\nWhether you\'re heading out for a casual day with friends or embracing your adventurous side, the Raven\'s Edge Women\'s Black Leather Jacket with Rugged Sleeves is a versatile choice. Pair it with your favorite jeans or a dress to instantly elevate your look.\r\n\r\nInvest in this timeless piece and let the Raven\'s Edge Women\'s Black Leather Jacket with Rugged Sleeves be a staple in your wardrobe, adding an element of rugged chicness and sophistication to your style. Embrace your inner adventurer and make a fashion statement with this exquisite leather jacket.', 'ravens-edge-womens-black-leather-jacket-with-rugged-sleeves', 1, 1, 1, 'Raven\'s Edge Women\'s Black Leather Jacket with Rugged Sleeves', '', '', NULL, NULL, NULL, NULL, NULL, '2023-11-10 16:49:01', 'en', 'default', 2, 197, '2023-11-10 16:53:24', NULL, 1),
