(203, 'PWRBRAS2023', 'configurable', '', 'PowerPulse Women\'s High Impact Sports Bra', '<p>Achieve peak performance during your workouts with our PowerPulse Women\'s High Impact Sports Bra. Designed for intense workouts, this sports bra provides high impact support, moisture-wicking technology, and breathable mesh panels. Embrace the power and style with PowerPulse.</p>', '<p>Introducing PowerPulse Women\'s High Impact Sports Bra, your essential partner for high-intensity workouts. This sports bra is crafted to provide exceptional support and comfort during intense exercises, making it perfect for running, HIIT, cross-training, and more. The high impact support ensures that you stay in place, no matter how rigorous your workout. The moisture-wicking fabric efficiently manages sweat, keeping you dry and focused. Breathable mesh panels enhance ventilation, providing additional comfort during your sessions. The racerback design not only offers flexibility and ease of movement but also adds a stylish touch to your active look. The wide underbust band ensures a secure fit, giving you the confidence to push your limits. Embrace the power and style of PowerPulse Women\'s High Impact Sports Bra. Experience the support, the comfort, and the freedom to conquer your workouts. Make a statement with this sports bra and power through your fitness journey.</p>', 'powerpulse-womens-high-impact-sports-bra', 1, 1, 1, 'PowerPulse Women\'s High Impact Sports Bra', '', 'Embrace the power and style of PowerPulse Women\'s High Impact Sports Bra. Experience the support, the comfort, and the freedom to conquer your workouts.', NULL, NULL, NULL, NULL, NULL, '2023-11-10 17:04:09', 'en', 'default', 7, 203, '2025-08-18 19:59:18', NULL, 1),
