(247, 'BLUESKIESFROCK2023', 'configurable', '', 'Blue Skies Girls\' Net Frocks with Stylish Bow', 'Let your little princess shine in our Blue Skies Girls\' Net Frocks with Stylish Bow. The elegant bow adds a touch of sophistication to this outfit, and the below knee-length design keeps it trendy and playful. Crafted from soft and comfortable net fabric, this frock is perfect for various occasions, making your little one look absolutely adorable.', 'Introducing the Blue Skies Girls\' Net Frocks with Stylish Bow, a piece that exudes grace and elegance. This beautiful frock is designed to make your little princess look charming on various occasions.\r\n\r\nThe star of this outfit is the elegant bow that adds a touch of sophistication and style to the frock. It\'s a perfect accent that elevates the entire look and makes it suitable for special events and gatherings.\r\n\r\nThe below knee-length design keeps the outfit trendy and playful, allowing your little one to move comfortably and with grace. The A-line silhouette provides a flattering appearance, making your princess look even more adorable.\r\n\r\nCrafted from soft and comfortable net fabric, this frock is gentle on your child\'s skin, making it suitable for all-day wear. The frock is also lined with polyester to ensure comfort and a polished look.\r\n\r\nLet your little princess shine like the blue skies in this lovely frock. The Blue Skies Girls\' Net Frocks with Stylish Bow are perfect for creating unforgettable memories and ensuring your little one stands out with elegance and grace at any event.', 'blue-skies-girls-net-frocks-with-stylish-bow', 1, 1, 1, 'Blue Skies Girls\' Net Frocks with Stylish Bow', '', 'Let your little princess shine in our Blue Skies Girls\' Net Frocks with Stylish Bow. The elegant bow adds a touch of sophistication to this outfit, and the below knee-length design keeps it trendy and playful. Crafted from soft and comfortable net fabric, this frock is perfect for various occasions, maki