(252, 'ELEGENTBLOOMTEE-23', 'configurable', '', 'Zesty Vibes Orange 100% Cotton Printed T-Shirt', 'Add a pop of color to your wardrobe with our Zesty Vibes Orange Printed T-Shirt. This vibrant orange tee features a stylish print, giving you a trendy and modern look. Crafted from comfortable and breathable cotton, it\'s perfect for various occasions and everyday wear.', 'Introducing the Zesty Vibes Orange Printed T-Shirt, a piece that radiates energy and liveliness. This vibrant orange tee is designed to make a statement and add a pop of color to your wardrobe.\r\n\r\nThe t-shirt features a stylish print that adds a trendy and modern touch to your outfit, making it suitable for various occasions. Pair it with jeans, shorts, or skirts for a casual yet chic look.\r\n\r\nCrafted from 100% cotton, this t-shirt ensures comfort and breathability, making it perfect for all-day wear. The regular fit allows for versatility, making it a go-to choice for everyday use.\r\n\r\nExpress yourself with the Zesty Vibes Orange Printed T-Shirt and let your style reflect your vibrant personality. Wear it and infuse your day with a burst of zest and enthusiasm. Embrace the bright and lively look that this tee offers, making you stand out wherever you go.', 'zesty-vibes-orange-100-cotton-printed-t-shirt', 1, 1, 1, 'Zesty Vibes Orange 100% Cotton Printed T-Shirt', '', 'Add a pop of color to your wardrobe with our Zesty Vibes Orange Printed T-Shirt. This vibrant orange tee features a stylish print, giving you a trendy and modern look. Crafted from comfortable and breathable cotton, it\'s perfect for various occasions and everyday wear.', NULL, NULL, NULL, NULL, NULL, '2023-11-15 11:21:48', 'en', 'default', 10, 252, '2023-11-15 11:26:11', NULL, 1),
