(257, 'SDYFROCK2023', 'configurable', '', 'Sunny Days Yellow Knee-Length Cotton Frock with Collar for Girls', 'Dress your little princess in our Sunny Days Yellow Knee-Length Frock with Collar. This bright and cheerful frock is designed to bring a smile to her face. The knee-length design and stylish collar make it perfect for playtime and special occasions. Crafted from comfortable and breathable material, it\'s a must-have for her wardrobe.', 'Introducing the Sunny Days Yellow Knee-Length Frock with Collar for Girls, a delightful piece that brings a burst of sunshine to your little one\'s style. The bright yellow color of this frock radiates vibrancy and cheerfulness.\r\n\r\nThe knee-length design and stylish collar add a classic touch to the frock, making it perfect for various occasions. Whether it\'s a family gathering, a day at school, or a birthday party, this frock is versatile and can be styled to suit any event.\r\n\r\nCrafted from a soft and breathable cotton blend, this frock ensures your little one\'s comfort all day long. The A-line silhouette gives the frock a playful and cute appearance, perfect for your little princess\'s playful spirit.\r\n\r\nThe Sunny Days Yellow Knee-Length Frock with Collar is a must-have addition to your little girl\'s wardrobe. Let her twirl and play with grace and elegance in this lovely frock, creating wonderful memories filled with sunshine and joy.', 'sunny-days-yellow-knee-length-cotton-frock-with-collar-for-girls', 1, 1, 1, 'Sunny Days Yellow Knee-Length Cotton Frock with Collar for Girls', '', 'Dress your little princess in our Sunny Days Yellow Knee-Length Frock with Collar. This bright and cheerful frock is designed to bring a smile to her face. Crafted from comfortable and breathable material, it\'s a must-have for her wardrobe.', NULL, NULL, NULL, NULL, NULL, '2023-11-15 11:27:56', 'en', 'default', 10, 257, '2023-11-15 11:32:07', NULL, 1),
