(354, 'MUS-LPG-001', 'downloadable', '', 'MusicMaestro- Learn to Play Guitar: A Step-by-Step Guide for Beginners', 'Unleash your inner musician and learn to play the guitar with our beginner-friendly guide, \"Learn to Play Guitar: A Step-by-Step Guide for Beginners\". This comprehensive resource provides easy-to-follow lessons, clear explanations, interactive exercises, and practice songs to help you master the fundamentals of guitar playing.', 'Whether you are a complete novice or has a basic understanding of guitar concepts, our guide caters to all levels, ensuring a fun and rewarding learning experience. Download your copy today and watch yourself embark on an exciting journey!\r\nEasy-to-follow lessons for mastering guitar basics, Clear explanations of guitar chords, strumming patterns, and fingerpicking techniques, Interactive exercises and practice songs to reinforce learning, Downloadable video lessons and guitar tab sheets for convenient practice.', 'musicmaestro--learn-to-play-guitar-a-step-by-step-guide-for-beginners', 1, 1, 1, 'MusicMaestro- Learn to Play Guitar: A Step-by-Step Guide for Beginners', '', 'Unleash your inner musician and learn to play the guitar with our beginner-friendly guide, \"Learn to Play Guitar: A Step-by-Step Guide for Beginners\".', 27.9900, 25.9900, NULL, NULL, NULL, '2023-11-15 16:54:14', 'en', 'default', 16, 354, '2023-11-15 17:10:04', NULL, 1),
(356, 'CXMPASS2023', 'virtual', '', 'CineXperience Monthly Movie Pass', 'Elevate your cinematic journey with the CineXperience Monthly Movie Pass at $99 per month. Immerse yourself in the magic of 10 movies each month without extra charges. Valid nationwide with no blackout dates, this pass offers exclusive perks and concession discounts, making it a must-have for movie enthusiasts.', 'Introducing the CineXperience Monthly Movie Pass, designed for true movie enthusiasts who crave a consistent dose of cinematic joy. Priced at $99 per month, this pass lets you enjoy the magic of 10 movies each month without any additional charges.\r\n\r\nWith access to participating theaters nationwide and no blackout dates or restrictions, the CineXperience Monthly Movie Pass is your key to a cinematic adventure that knows no bounds. Whether you\'re a film buff or someone who loves regular movie nights, this pass caters to your passion.\r\n\r\nAs a pass holder, you not only get the thrill of unlimited movies but also exclusive perks and discounts on concessions. Enhance your movie-going experience with easy online booking and seat selection, ensuring you make the most of every screening.\r\n\r\nFor those who consider the cinema a second home, the CineXperience Monthly Movie Pass is a ticket to a month filled with stories, laughter, and awe-inspiring moments on the big screen. Treat yourself or gift the ultimate cinematic experience to someone special. Don\'t miss out on the joy  subscribe to CineXperience Monthly Movie Pass and let the movies come to life!', 'cinexperience-monthly-movie-pass', 1, 1, 1, 'CinemaFlex Monthly Movie Pass', '', 'Elevate your cinematic journey with the CineXperience Monthly Movie Pass at $99 per month. Immerse yourself in the magic of 10 movies each month without extra charges. Valid nationwide with no blackout dates, this pass offers exclusive perks and concession discounts, making it a must-have for movie enthusiasts.', 99.0000, NULL, NULL, NULL, NULL, '2