(452, 'BLOOMINGFLAT2023', 'configurable', '', 'Blooming Elegance Women\'s Designer Floral Print Flat Shoes', 'Step into a garden of style with our Blooming Elegance Women\'s Designer Floral Print Flat Shoes. These designer flats feature a captivating floral print that adds a chic touch to your look. The comfortable flat sole ensures all-day wear, making them suitable for various casual and semi-formal occasions. Slip into effortless grace with these beautiful shoes.', 'Introducing our Blooming Elegance Women\'s Designer Floral Print Flat Shoes, a pair of flats that are as comfortable as they are stylish.\r\n\r\nThese designer flat shoes are adorned with a captivating floral print that adds a chic and trendy element to your ensemble. The floral design gives the impression of walking through a garden of beauty, making these shoes a delightful addition to your wardrobe.\r\n\r\nThe comfortable flat sole of these shoes ensures that you can go about your day with ease, without the discomfort of high heels. These flats are versatile and suitable for various casual and semi-formal occasions, making them perfect for outings with friends or even a relaxed day at the office.\r\n\r\nCrafted from high-quality textile, these shoes are built to withstand the test of time and provide you with long-lasting performance. The slip-on style allows for effortless grace, so you can easily slip into these beautiful shoes and be ready to embrace the world with style and comfort.\r\n\r\nStep into a world of fashion inspired by nature with Blooming Elegance Women\'s Designer Floral Print Flat Shoes. These shoes are more than just footwear; they are an expression of your love for style and a reflection of your vibrant personality. Embrace the beauty of flowers and step out in style with these captivating and comfortable flats.', 'blooming-elegance-womens-designer-floral-print-flat-shoes', 1, 1, 1, 'Blooming Elegance Women\'s Designer Floral Print Flat Shoes', '', 'Step into a garden of style with our Blooming Elegance Women\'s Designer Floral Print Flat Shoes. These designer flats feature a captivating floral print that adds a chic touch to your look. The comfortable flat sole ensures all-day wear, making them suitable for various casual and semi-formal occasions. Slip into effortless grace with these beautiful shoes.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 15:46:05', 'en', 'default', 14, 452, '2023-11-16 15:59:43', NULL, 1),
