(457, 'MIDNIGHTBLOSSOMHEELS2023', 'configurable', '', 'Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels', 'Elevate your style and embrace nature\'s beauty with our Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels. These stunning high heel sandals/heels feature a captivating floral print that adds a touch of elegance to your look. The comfortable fit ensures all-day wear, making them suitable for various formal and special occasions with a secure buckle closure.', 'Introducing our Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels, a pair of shoes designed to make you stand out and embrace the beauty of nature.\r\n\r\nThese high heel sandals/heels are adorned with a captivating floral print that adds a touch of elegance and a connection to nature to your ensemble. The floral design captures the essence of a midnight garden in full bloom, making these shoes a captivating addition to your wardrobe.\r\n\r\nThe comfortable and secure fit of these sandals/heels ensures that you can enjoy your special occasion or formal event without any discomfort. The buckle closure provides a secure and adjustable fit, allowing you to dance and move with confidence.\r\n\r\nCrafted from high-quality synthetic leather, these sandals/heels are designed to provide long-lasting performance and maintain their stunning appearance. Step into Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels and step into a world of style, elegance, and the beauty of nature. These shoes are not just footwear; they are a statement of your exquisite taste and your desire to be one with the beauty of the night. Make a lasting impression at every formal event with these captivating and elegant high heel sandals/heels.', 'midnight-blossom-womens-black-floral-print-high-heel-sandalsheels', 1, 1, 1, 'Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels', '', 'Elevate your style and embrace nature\'s beauty with our Midnight Blossom Women\'s Black Floral Print High Heel Sandals/Heels. The comfortable fit ensures all-day wear, making them suitable for various formal and special occasions with a secure buckle closure.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 15:59:55', 'en', 'default', 14, 457, '2023-11-16 16:03:33', NULL, 1),
