(462, 'URBANEDGESNEAKERS2023', 'configurable', '', 'Urban Edge Men\'s High Ankle Sneakers', 'Elevate your street style with our Urban Edge Men\'s High Ankle Sneakers. These high ankle sneakers are the perfect blend of modern and urban fashion, offering a stylish and versatile design. Enjoy all-day comfort with cushioned insoles and a secure fit with the lace-up closure.', 'Introducing our Urban Edge Men\'s High Ankle Sneakers, the ultimate choice for those who want to step into the world of modern and urban fashion.\r\n\r\nThese high ankle sneakers offer a stylish and contemporary look that complements your street style perfectly. Whether you\'re going for a casual outing, a sporty adventure, or simply want to add an urban touch to your everyday wear, these sneakers are designed to fit your lifestyle.\r\n\r\nThe comfort provided by these sneakers is unmatched, thanks to the cushioned insoles that allow you to wear them all day without discomfort. The durable and high-quality materials, including synthetic leather and mesh, ensure that these sneakers will accompany you on your urban adventures for a long time.\r\n\r\nThe lace-up closure not only provides a secure fit but also allows for adjustability, ensuring that your sneakers stay snugly on your feet no matter where your day takes you.\r\n\r\nElevate your street style and embrace the urban edge with Urban Edge Men\'s High Ankle Sneakers. They are more than just shoes; they are an expression of your modern and urban lifestyle. Step into these stylish and comfortable high ankle sneakers and make a bold fashion statement with every step.', 'urban-edge-mens-high-ankle-sneakers', 1, 1, 1, 'Urban Edge Men\'s High Ankle Sneakers', '', 'Elevate your street style with our Urban Edge Men\'s High Ankle Sneakers. These high ankle sneakers are the perfect blend of modern and urban fashion, offering a stylish and versatile design. Enjoy all-day comfort with cushioned insoles and a secure fit with the lace-up closure.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 16:06:58', 'en', 'default', 5, 462, '2023-11-16 16:12:38', NULL, 1),
