(468, 'URBANSLEEKLEATHER2023', 'configurable', '', 'Urban Sleek Men\'s Black Lace-Up Leather Sneakers', 'Elevate your fashion game with our Urban Sleek Men\'s Black Lace-Up Leather Sneakers. These black leather sneakers feature a sleek lace-up design that exudes sophistication and modern urban fashion. Enjoy all-day comfort with cushioned insoles and embrace the high-quality and durable materials. These versatile sneakers are suitable for various casual and semi-formal occasions.', 'Introducing our Urban Sleek Men\'s Black Lace-Up Leather Sneakers, a footwear choice that combines timeless sophistication with a touch of modern urban fashion.\r\n\r\nThese black leather sneakers are a stylish and versatile addition to your wardrobe. The sleek lace-up design not only adds an element of sophistication but also keeps you in line with modern urban trends. Whether you\'re heading to a casual get-together, a semi-formal gathering, or simply want to enhance your everyday style, these sneakers are designed to complement your look.\r\n\r\nThe comfort offered by these sneakers is top-notch, thanks to the cushioned insoles that allow you to wear them for extended periods without discomfort. The high-quality genuine leather ensures that these sneakers not only look elegant but also provide long-lasting performance, withstanding daily wear and tear.\r\n\r\nEmbrace the blend of timeless elegance and modern urban fashion with Urban Sleek Men\'s Black Lace-Up Leather Sneakers. These sneakers are more than just footwear; they are a representation of your refined taste and your desire to make a stylish statement. Step into these sleek and comfortable leather sneakers and step out in style, ready to leave a lasting impression with every step you take.', 'urban-sleek-mens-black-lace-up-leather-sneakers', 1, 1, 1, 'Urban Sleek Men\'s Black Lace-Up Leather Sneakers', '', 'Elevate your fashion game with our Urban Sleek Men\'s Black Lace-Up Leather Sneakers. These black leather sneakers feature a sleek lace-up design that exudes sophistication and modern urban fashion. Enjoy all-day comfort with cushioned insoles and embrace the high-quality and durable materials. These versatile sneakers are suitable for various casual and semi-formal occasions.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 16:14:18', 'en', 'default', 5, 468, '2023-11-16 16:21:10', NULL, 1),
