rides Boys\' Smart and Stylish Black Lace-Up Shoes. These black lace-up shoes exude classic charm and versatility, making them suitable for various occasions. Crafted from high-quality synthetic leather, they promise durability and comfort for everyday wear and special events.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 17:15:53', 'en', 'default', 9, 496, '2023-11-16 17:57:40', NULL, 1),
