reet Art High-Top Sneakers', '', 'Elevate your young artist\'s style with Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers. These high-top sneakers feature a dynamic street art graffiti pattern that allows them to express their artistic side.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 17:58:20', 'en', 'default', 9, 501, '2023-11-16 18:17:17', NULL, 1),
