(516, 'COLORFUSIONOUTDOOR2023', 'configurable', '', 'ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers', 'Elevate your boy\'s active style with ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers. These vibrant and eye-catching sneakers are designed for an active lifestyle, perfect for outdoor adventures, playdates, and casual outings. Crafted from high-quality synthetic leather and mesh, they promise durability and a comfortable fit for all-day, active wear.', 'Introducing our ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers, a pair of shoes designed to make a bold statement in every step.\r\n\r\nThese outdoor sneakers are not just footwear; they are a vibrant expression of an active lifestyle. The multicolor design, bursting with energy and eye-catching details, is ideal for boys who love outdoor adventures, playdates, and casual outings. Whether he\'s exploring nature, running around with friends, or simply showcasing his unique style, these sneakers are the perfect choice.\r\n\r\nThe high-quality synthetic leather and mesh materials ensure that these sneakers are durable and built to withstand the active life of a growing boy. They provide a comfortable fit, allowing for all-day wear without discomfort.\r\n\r\nElevate your boy\'s active style with ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers. These sneakers are more than just footwear; they are a reflection of energy, playfulness, and a love for the outdoors. Let your boy step into a world of vibrant style and embark on his adventures with confidence, all while making a bold statement with each step.', 'colorfusion-boys-stylish-multicolor-outdoor-sneakers', 1, 1, 1, 'ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers', '', 'Elevate your boy\'s active style with ColorFusion Boys\' Stylish Multicolor Outdoor Sneakers. Crafted from high-quality synthetic leather and mesh, they promise durability and a comfortable fit for all-day, active wear.', NULL, NULL, NULL, NULL, NULL, '2023-11-16 1