(594, 'tab-02', 'simple', '8-Inch Compact Tablet with Wi-Fi & 32GB Storage  Ideal for Everyday Use', '8-Inch Compact Tablet with Wi-Fi & 32GB Storage  Ideal for Everyday Use', '<p data-start=\"244\" data-end=\"403\">Portable 8\" tablet with responsive touchscreen, Wi-Fi connectivity, 32GB storage, and all-day battery life&mdash;perfect for reading, streaming, and casual browsing.</p>', '<p>Experience the perfect blend of portability and performance with this 8-inch compact tablet. Designed for everyday tasks, it features a bright and responsive HD touchscreen, making it ideal for reading eBooks, watching videos, or browsing the web. With 32GB of built-in storage (expandable up to 128GB via microSD), there\'s plenty of space for apps and media. The tablet runs on a lightweight operating system, ensuring smooth performance and easy navigation. Built-in Wi-Fi, a front-facing camera for video calls, and an all-day battery make it a reliable companion for home, travel, or school.</p>', '8-inch-compact-tablet-with-wi-fi-32gb-storage-ideal-for-everyday-use', 1, 1, 1, '', '', '', 75.6600, NULL, NULL, NULL, 1.2000, '2025-05-15 13:02:35', 'en', 'default', 15, 567, '2025-08-20 16:17:14', NULL, 1),
