(598, 'office-chair', 'simple', 'Mesh Office Chair with Lumbar Support & Adjustable Height', 'Mesh Office Chair with Lumbar Support & Adjustable Height', '<p>Comfortable ergonomic office chair with breathable mesh back, lumbar support, adjustable seat height, and smooth-rolling wheels.</p>', '<p>Work in comfort and style with this ergonomic office chair designed to support your posture during long hours at your desk. The breathable mesh back promotes airflow, keeping you cool, while built-in lumbar support encourages healthy spine alignment. Easily adjust the seat height to suit your desk setup, and enjoy full mobility with 360-degree swivel and smooth-rolling caster wheels. Ideal for home offices, corporate workspaces, or study areas, this chair offers the perfect blend of functionality and modern design.</p>', 'mesh-office-chair-with-lumbar-support-adjustable-height', 1, 1, 1, '', '', '', 45.1000, NULL, NULL, NULL, 1.2000, '2025-05-15 13:17:31', 'en', 'default', 15, 569, '2025-11-12 11:44:26', NULL, 1),
