(600, 'watch', 'simple', 'Smart Fitness Watch with Heart Rate Monitor & Activity Tracking', 'Smart Fitness Watch with Heart Rate Monitor & Activity Tracking', '<p>Track your health and fitness goals with this smart fitness watch featuring heart rate monitoring, step tracking, sleep analysis, and smartphone notifications.</p>', '<p>Stay on top of your wellness journey with this sleek and reliable smart fitness watch. Designed for daily use, it monitors your heart rate, counts your steps, tracks calories burned, and even analyzes your sleep patterns. The vibrant display offers real-time stats, while Bluetooth connectivity keeps you updated with call, SMS, and app notifications right on your wrist. Water-resistant and lightweight, it&rsquo;s perfect for workouts, outdoor activities, and everyday wear. With a long-lasting battery and multiple sport modes, this watch is your ideal fitness companion.</p>', 'smart-fitness-watch-with-heart-rate-monitor-activity-tracking', 1, 1, 1, '', '', '', 25.0000, NULL, NULL, NULL, 1.2000, '2025-05-15 13:31:07', 'en', 'default', 15, 570, '2025-11-12 11:21:03', NULL, 1),
