(701, 'COMPLETELOOKSET2023', 'bundle', '', NULL, 'Elevate your fashion game with our All-in-One Smart Casual Outfit Set. This complete look includes an open full sleeve smart jacket, a blue full sleeve t-shirt, grey denim jeans, and sneaker shoes. Crafted from high-quality materials, this set offers a coordinated and hassle-free fashion choice for various occasions, ensuring you look stylish and comfortable.', 'Introducing the All-in-One Smart Casual Outfit Set, your ticket to effortless style and comfort for various occasions.\r\n\r\nThis complete outfit set is designed to make your fashion choices easy and stylish. It includes everything you need for a smart and casual look, so you can dress confidently without worrying about coordinating individual pieces.\r\n\r\nThe open full sleeve smart jacket adds a touch of sophistication to your ensemble. It\'s perfect for layering and creating a polished look, whether you\'re heading to the office or a dinner date.\r\n\r\nThe stylish blue full-sleeve t-shirt is a versatile addition to your wardrobe. It adds a trendy and eye-catching element to your outfit, making it suitable for casual outings, parties, or just hanging out with friends.\r\n\r\nThe grey denim jeans are a classic choice that offers both style and comfort. They are perfect for various occasions, from a laid-back day at the park to a night out in the city.\r\n\r\nCompleting the ensemble, the sneaker shoes provide the finishing touch of style and comfort. They are suitable for all-day wear and keep your feet feeling fresh, whether you\'re running errands or exploring the town.\r\n\r\nEach piece of this outfit set is crafted from high-quality materials to ensure comfort and durability. The coordinated look saves you time and effort, so you can focus on enjoying your day.\r\n\r\nElevate your fashion game with the All-in-One Smart Casual Outfit Set. This set is more than just clothing; it\'s a reflection of your desire for style and convenience. Let it simplify your fashion choices and elevate your look for any occasion, making you stand out with ease and confidence.', 'all-in-one-smart-casual-outfit-set', 1, 1, 1, 'All-in-One Smart Casual Outfit Set', '', 'Elevate your fashion game with our All-in-One Smart Casual Outfit Set. This complete look includes an open full sleeve smart jacket, a blue full sleeve t-shirt, grey denim jeans, and sneaker shoes. Crafted from high-quality materials, this set offers a coordinated and hassle-free fashion choice for various occasions, ensuring you look stylish and comfortable.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:12', 'ar', 'default', 17, 174, '2025-08-14 13:16:12', NULL, 1),
(702, 'ARCTICFROSTACC2023', 'grouped', '', NULL, 'Embrace the winter chill with our Arctic Frost Winter Accessories Bundle. This curated set includes a luxurious scarf, a cozy beanie, touchscreen-compatible gloves and wool Blend Socks. Stylish and functional, this ensemble is crafted from high-quality materials, ensuring both durability and comfort. Elevate your winter wardrobe or delight someone special with this perfect gifting option.', 'Introducing the Arctic Frost Winter Accessories Bundle, your go-to solution for staying warm, stylish, and connected during the chilly winter days.\r\n\r\nThis thoughtfully curated set brings together Four essential winter accessories to create a harmonious ensemble. The luxurious scarf, woven from a blend of acrylic and wool, not only adds a layer of warmth but also brings a touch of elegance to your winter wardrobe. The soft knit beanie, crafted with care, promises to keep you cozy while adding a fashionable flair to your look.\r\n\r\nBut it doesn\'t end there  our bundle also includes touchscreen-compatible gloves. Stay connected without sacrificing warmth as you navigate your devices effortlessly. Whether you\'re answering calls, sending messages, or capturing winter moments on your smartphone, these gloves ensure convenience without compromising style.\r\n\r\nThe soft and cozy texture of the socks offers a luxurious feel against your skin. Say goodbye to chilly feet as you embrace the plush warmth provided by these wool blend socks.\r\n\r\nThe Arctic Frost Winter Accessories Bundle is not just about functionality; it\'s a statement of winter fashion. Each piece is designed not only to protect you from the cold but also to elevate your style during the frosty season. The materials chosen for this bundle prioritize both durability and comfort, ensuring that you can enjoy the winter wonderland in style.\r\n\r\nWhether you\'re treating yourself or searching for the perfect gift, the Arctic Frost Winter Accessories Bundle is a versatile choice. Delight someone special during the holiday season or elevate your own winter wardrobe with this stylish and functional ensemble. Embrace the frost with confidence, knowing that you have the perfect accessories to keep you warm and chic.', 'arctic-frost-winter-accessories-bundle', 1, 1, 1, 'Arctic Frost Winter Accessories Bundle', '', 'Elevate your fashion game with our All-in-One Smart Casual Outfit Set. This complete look includes an open full sleeve smart jacket, a printed black t-shirt, blue denim jeans, and sneaker shoes. Crafted from high-quality materials, this set offers a coordinated and hassle-free fashion choice for various occasions, ensuring you look stylish and comfortable.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:12', 'ar', 'default', 17, 175, '2025-08-14 13:16:12', NULL, 1),
(703, 'COASTALBREEZEMENSHOODIE', 'configurable', '', NULL, 'Stay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This fashionable hoodie features a modern design, making it ideal for casual and active wear. The soft and cozy interior lining provides warmth, while the full zipper closure allows for versatile styling and temperature control. Convenient front pockets are perfect for storage and keeping your hands warm.', 'The Coastal Breeze Men\'s Blue Zipper Hoodie is your reliable companion for staying warm, comfortable, and stylish.\r\n\r\nThis hoodie is designed for the modern man who values both fashion and functionality. The stylish blue design adds a touch of contemporary flair, making it suitable for various occasions, whether you\'re running errands, heading to the gym, or simply enjoying a relaxed day out.\r\n\r\nWarmth is a top priority, and this hoodie delivers. The interior lining is soft and cozy, ensuring that you stay comfortable and warm even in cooler weather. It\'s the perfect addition to your wardrobe when you need that extra layer of insulation.\r\n\r\nThe full zipper closure is not just about style; it allows you to control your comfort and temperature easily. You can wear the hoodie fully zipped for maximum warmth or open it up for a more relaxed look. This versatility makes it a go-to choice for various settings.\r\n\r\nConvenience is key, and the front pockets provide just that. They are perfect for storing your essentials, whether it\'s your phone, wallet, or keys. Plus, they keep your hands warm during chilly days.\r\n\r\nCrafted from a comfortable and durable cotton blend, this hoodie is designed to withstand everyday wear and maintain its stylish appeal.\r\n\r\nStay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This hoodie is more than just clothing; it\'s a reflection of your modern and practical fashion sense. Let it be your reliable choice for staying cozy and fashionable in any situation, ensuring you look and feel your best.', 'coastal-breeze-mens-blue-zipper-hoodie', 1, 1, 1, 'Coastal Breeze Men\'s Blue Zipper Hoodie', '', 'Stay warm and stylish with the Coastal Breeze Men\'s Blue Zipper Hoodie. This fashionable hoodie features a modern design, making it ideal for casual and active wear. The soft and cozy interior lining provides warmth, while the full zipper closure allows for versatile styling and temperature control.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:12', 'ar', 'default', 2, 176, '2025-08-14 13:16:12', NULL, 1),
