(751, 'RAINBOWSWIRLFROCK2023', 'configurable', '', NULL, 'Let your little girl twirl and play in our Rainbow Swirl Girls\' Satin Blend Multicolor Printed Circle Frock Dress. The beautiful multicolor swirl print and luxurious satin blend fabric make it a delightful choice for parties and special occasions. The circle frock design adds a playful touch, ensuring she looks charming and feels comfortable.', 'Introducing the Rainbow Swirl Girls\' Satin Blend Multicolor Printed Circle Frock Dress, a whirl of vibrant colors and playful design for your little fashionista. This dress is designed to add a touch of charm and playfulness to any occasion.\r\n\r\nThe beautiful multicolor swirl print on the dress is eye-catching and vibrant, making it a delightful choice for parties, special events, or simply a day of play. The satin blend fabric provides a soft and luxurious feel against your child\'s skin, ensuring she remains comfortable and stylish.\r\n\r\nThe circle frock design adds a playful touch to the dress, making it twirl-worthy and charming. The knee-length dress is both stylish and allows for ease of movement, allowing your little one to dance and play without any hindrance.\r\n\r\nLet your little princess stand out in the crowd with the Rainbow Swirl Girls\' Satin Blend Multicolor Printed Circle Frock Dress. It\'s the perfect ensemble for creating unforgettable moments filled with color, style, and playful fun. Watch her twirl and swirl in this delightful frock, creating memories that she\'ll cherish forever.', 'rainbow-swirl-girls-satin-blend-printed-circle-frock-dress', 1, 1, 1, 'Rainbow Swirl Girls\' Satin Blend Printed Circle Frock Dress', '', 'Let your little girl twirl and play in our Rainbow Swirl Girls\' Satin Blend Multicolor Printed Circle Frock Dress. The beautiful multicolor swirl print and luxurious satin blend fabric make it a delightful choice for parties and special occasions.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:15', 'ar', 'default', 10,