(824, 'URBANEXPLORERHD2023', 'configurable', '', NULL, 'Embrace urban style with our Urban Explorer Boys\' Full Sleeve Blue Designer Full Zipper Hoodie. The stylish designer patterns and full zipper closure add a trendy touch to this hoodie. Crafted from warm and insulating material, it\'s perfect for cooler weather and various casual outings.', 'Help your young girl embrace her individuality with our Groovy Girl Jeans, designed to inspire creativity and self-expression. These comfy jeans are crafted from soft denim fabric, ensuring all-day comfort during her playtime adventures. The relaxed fit allows for easy movement, while the funky patches and beads add a touch of personality to her look. Whether she\'s painting masterpieces or skateboarding with friends, these jeans will let her shine.', 'urban-explorer-boys-full-sleeve-blue-designer-full-zipper-hoodie', 1, 1, 1, 'Urban Explorer Boys\' Full Sleeve Blue Designer Full Zipper Hoodie', '', 'Embrace urban style with our Urban Explorer Boys\' Full Sleeve Blue Designer Full Zipper Hoodie. The stylish designer patterns and full zipper closure add a trendy touch to this hoodie. Crafted from warm and insulating material, it\'s perfect for cooler weather and various casual outings.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:20', 'ar', 'default', 10, 301, '2025-08-14 13:16:20', NULL, 1),
