(829, 'ADVENTURETSHIRT2023', 'configurable', '', NULL, 'Let your little adventurer stand out in our Adventure Seeker Boys\' Half Sleeve Graphic T-Shirt. The eye-catching graphic design adds a playful and trendy element to his outfit. Crafted from a soft and breathable fabric, this t-shirt is perfect for various casual occasions, ensuring both comfort and style.', 'Inspire your little explorer with our Adventure Seeker Boys\' Half Sleeve Graphic T-Shirt. This t-shirt features an eye-catching graphic design, perfect for igniting a sense of adventure and playfulness in your child.\r\n\r\nThe half sleeve design ensures comfort and style, making it suitable for everyday wear. The soft and breathable cotton blend fabric provides a gentle and cozy feel against your child\'s skin, allowing him to stay comfortable all day long.\r\n\r\nThis t-shirt is versatile and can be easily paired with different bottoms, allowing your child to create a variety of outfits. Whether it\'s a day at school, a casual outing, or a playdate with friends, this graphic t-shirt is a trendy choice that your little adventurer will love.\r\n\r\nLet your child\'s imagination roam free with our Adventure Seeker Boys\' Half Sleeve Graphic T-Shirt. It\'s more than just a t-shirt; it\'s an invitation to embrace the spirit of adventure and create unforgettable childhood memories. Watch your little one shine in this playful and stylish t-shirt, designed for young explorers and adventure seekers.', 'adventure-seeker-boys-half-sleeve-graphic-t-shirt', 1, 1, 1, 'Adventure Seeker Boys\' Half Sleeve Graphic T-Shirt', '', 'Let your little adventurer stand out in our Adventure Seeker Boys\' Half Sleeve Graphic T-Shirt. The eye-catching graphic design adds a playful and trendy element to his outfit. Crafted from a soft and breathable fabric, this t-shirt is perfect for various casual occasions, ensuring both comfort and style.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:20', 'ar', 'default', 10, 306, '2025-08-