(834, 'PUREWHTSNEAK2023', 'configurable', '', NULL, 'Step into timeless style and comfort with our PureStride Men\'s Classic White Sneakers. Featuring a classic white design, these sneakers offer both comfort and support for all-day wear. The durable construction ensures long-lasting use, while the lace-up closure provides a secure fit. Versatile and lightweight, these sneakers are perfect for various occasions.', 'Introducing PureStride Men\'s Classic White Sneakers, a perfect blend of style, comfort, and versatility. The classic white design of these sneakers makes them a timeless addition to your footwear collection, ensuring they effortlessly complement various outfits and occasions.\r\n\r\nCrafted with a commitment to comfort, these sneakers provide the support you need for all-day wear. The synthetic leather upper offers a sleek look while ensuring durability, making them suitable for daily activities and casual outings.\r\n\r\nThe lace-up closure allows you to customize the fit, ensuring a secure and comfortable feel as you go about your day. The rubber sole adds traction and flexibility, making these sneakers lightweight and easy to move in.\r\n\r\nWhether you\'re heading to work, meeting friends, or simply going for a walk, PureStride Men\'s Classic White Sneakers are the perfect choice. Embrace the versatility and timeless appeal of white sneakers and step out with confidence and style. Elevate your everyday look with these comfortable and classic sneakers.', 'purestride-mens-classic-white-sneakers', 1, 1, 1, 'PureStride Men\'s Classic White Sneakers', '', 'Step into timeless style and comfort with our PureStride Men\'s Classic White Sneakers. Featuring a classic white design, these sneakers offer both comfort and support for all-day wear. The durable construction ensures long-lasting use, while the lace-up closure provides a secure fit. Versatile and lightweight, these sneakers are perfect for various occasions.', NULL, NULL, NULL, NULL, NULL, '2025-08-14