(866, 'BRNLEATH2023', 'configurable', '', NULL, 'Elevate your style with our EarthTone Men\'s Classic Brown Leather Jacket. Made from high-quality genuine leather, this jacket features a classic design that is both timeless and versatile. The multiple pockets and full-zip closure make it convenient for daily wear. A must-have for any fashion-forward man.', 'Introducing the EarthTone Men\'s Classic Brown Leather Jacket, a staple piece that embodies style and sophistication. Crafted from high-quality genuine leather, this jacket offers a timeless and versatile design that complements various outfit styles.\r\n\r\nThe classic brown hue adds a touch of warmth and richness to your overall look, making it a perfect choice for both casual and semi-formal occasions. The full-zip closure not only enhances the aesthetics but also provides easy wear and added warmth, making it suitable for different weather conditions.\r\n\r\nEquipped with multiple pockets, this jacket offers convenience and storage for your essentials, whether you\'re heading out for a casual day or a night out with friends. The comfortable fit ensures that it\'s perfect for everyday wear, allowing you to effortlessly transition from day to night.\r\n\r\nPair this EarthTone Men\'s Classic Brown Leather Jacket with jeans, chinos, or even tailored pants to create a polished and fashionable look. Experience the blend of durability, style, and comfort that comes with owning a genuine leather jacket. Elevate your fashion game and make a statement with this essential piece in your wardrobe.', 'earthtone-mens-classic-brown-leather-jacket', 1, 1, 1, 'EarthTone Men\'s Classic Brown Leather Jacket', '', 'Elevate your style with our EarthTone Men\'s Classic Brown Leather Jacket. Made from high-quality genuine leather, this jacket features a classic design that is both timeless and versatile. The multiple pockets and full-zip closure make it convenient for daily wear. A must-have for any fashion-forward man.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:23', 'ar', 'default', 2, 343, '2025-08-14 13:16:23', NULL, 1),
