(876, 'MUS-LPG-001', 'downloadable', '', NULL, 'Unleash your inner musician and learn to play the guitar with our beginner-friendly guide, \"Learn to Play Guitar: A Step-by-Step Guide for Beginners\". This comprehensive resource provides easy-to-follow lessons, clear explanations, interactive exercises, and practice songs to help you master the fundamentals of guitar playing.', 'Whether you are a complete novice or has a basic understanding of guitar concepts, our guide caters to all levels, ensuring a fun and rewarding learning experience. Download your copy today and watch yourself embark on an exciting journey!\r\nEasy-to-follow lessons for mastering guitar basics, Clear explanations of guitar chords, strumming patterns, and fingerpicking techniques, Interactive exercises and practice songs to reinforce learning, Downloadable video lessons and guitar tab sheets for convenient practice.', 'musicmaestro--learn-to-play-guitar-a-step-by-step-guide-for-beginners', 1, 1, 1, 'MusicMaestro- Learn to Play Guitar: A Step-by-Step Guide for Beginners', '', 'Unleash your inner musician and learn to play the guitar with our beginner-friendly guide, \"Learn to Play Guitar: A Step-by-Step Guide for Beginners\".', 27.9900, 25.9900, NULL, NULL, NULL, '2025-08-14 13:16:24', 'ar', 'default', 16, 354, '2025-08-14 13:16:24', NULL, 1),
(877, 'ELGKNT2023', 'configurable', '', NULL, 'Stay stylish and warm with our EleganceKnits Men\'s High-Quality Cardigan Sweatercoat. This premium sweater features high-quality knitting and a sophisticated turn-down collar design. Perfect for autumn and winter, the solid color adds a touch of elegance to your outfit. Versatile and comfortable for both casual and semi-formal occasions.', 'Introducing the EleganceKnits Men\'s High-Quality Cardigan Sweatercoat, a blend of sophistication, style, and comfort. This premium cardigan is crafted from a high-quality cotton blend, ensuring durability and a soft feel against your skin.\r\n\r\nThe knitting detail not only adds to the durability of the sweater but also gives it a stylish and refined look. The solid color enhances its elegance and versatility, making it suitable for various occasions and easy to pair with different outfits.\r\n\r\nOne of the standout features of this cardigan is the turn-down collar, which adds a touch of sophistication to your ensemble. The collar design not only provides style but also offers an extra layer of warmth, making it perfect for the autumn and winter seasons.\r\n\r\nThe comfortable fit of this cardigan ensures it\'s suitable for everyday wear, whether you\'re heading to the office, going for a casual outing, or meeting friends. Pair it with jeans, chinos, or trousers to achieve a polished and fashionable look.\r\n\r\nElevate your style with the EleganceKnits Men\'s High-Quality Cardigan Sweatercoat. Experience the perfect balance of warmth and fashion in this must-have piece for your autumn and winter wardrobe. Make a statement with this cardigan that exudes elegance and showcases your impeccable taste in fashion.', 'eleganceknits-mens-high-quality-cardigan-sweatercoat', 1, 1, 1, 'EleganceKnits Men\'s High-Quality Cardigan Sweatercoat', '', 'Stay stylish and warm with our EleganceKnits Men\'s High-Quality Cardigan Sweatercoat. This premium sweater features high-quality knitting and a sophisticated turn-down collar design. Versatile and comfortable for both casual and semi-formal occasions.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:24', 'ar', 'default', 2, 357, '2025-08-14 13:16:24', NULL, 1),
