ortable fit ensures all-day wear, making them suitable for various formal and special occasions with a secure buckle closure.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:27', 'ar', 'default', 14, 457, '2025-08-14 13:16:27', NULL, 1),
