ation and modern urban fashion. Enjoy all-day comfort with cushioned insoles and embrace the high-quality and durable materials. These versatile sneakers are suitable for various casual and semi-formal occasions.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:28', 'ar', 'default', 5, 468, '2025-08-14 13:16:28', NULL, 1),
