(960, 'URBANCANVASGRAFFITI2023', 'configurable', '', NULL, 'Elevate your young artist\'s style with Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers. These high-top sneakers feature a dynamic street art graffiti pattern that allows them to express their artistic side. Perfect for trendy and street-style fashion, they offer a comfortable fit for daily wear and urban adventures. Crafted from durable canvas, these sneakers promise long-lasting performance.', 'Introducing our Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers, a canvas for young artists to make bold fashion statements.\r\n\r\nThese high-top sneakers are more than just footwear; they are a canvas of self-expression. The dynamic street art graffiti pattern allows young boys to embrace their inner artist and add a touch of artistic flair to their style. Whether they\'re heading to school, a creative workshop, or simply want to make a trendy statement, these sneakers are the perfect choice.\r\n\r\nThe comfortable fit of these sneakers ensures that they can be worn daily without any discomfort. They are designed for urban adventures, allowing young boys to explore their surroundings with ease.\r\n\r\nCrafted from durable canvas, these sneakers are built to withstand the wear and tear of youthful energy. They promise long-lasting performance and the opportunity for your young artist to leave their mark on the world, one step at a time.\r\n\r\nElevate your young artist\'s style and provide them with a canvas for self-expression with Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers. These sneakers are more than just footwear; they are a reflection of creativity, individuality, and the desire to stand out in the crowd. Let your young artist make bold fashion statements and embrace the world with their unique sense of style and creativity.', 'urban-canvas-boys-dynamic-street-art-high-top-sneakers', 1, 1, 1, 'Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers', '', 'Elevate your young artist\'s style with Urban Canvas Boys\' Dynamic Street Art High-Top Sneakers. These high-top sneakers feature a dynamic street art graffiti pattern that allows them to express their artistic side.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:30', 'ar', 'default', 9, 501, '2025-08-14 13:16:30', NULL, 1),
