 Laces', '', 'Elevate your young gentleman\'s style with UrbanTracks Boys\' Stylish Low-Top Black and White Sneakers with Blue Laces. These classic black and white sneakers feature a unique twist with blue laces, offering a versatile design perfect for various casual occasions. Crafted from high-quality synthetic leather and rubber, they promise durability and a comfortable fit for everyday wear.', NULL, NULL, NULL, NULL, NULL, '2025-08-14 13:16:31', 'ar', 'default', 9, 511, '2025-08-14 13:16:31', NULL, 1),
