(1038, 'test-12299', 'simple', '', 'Classic Women Blazer', '<p>Elevate your professional and casual looks with our <strong>Classic Women Blazer</strong>. Tailored for a sleek, flattering fit, it combines timeless style with comfort, making it perfect for office wear, meetings, or smart casual occasions.</p>', '<p>Step into sophistication with our <strong>Classic Women Blazer</strong>, a wardrobe essential that never goes out of style. Designed with a tailored fit, it enhances your silhouette while offering comfort and ease of movement. The blazer features clean lines, a structured design, and premium-quality fabric, giving you a polished, professional appearance suitable for work, meetings, or formal events.</p>\n<p>Its versatile design allows you to pair it effortlessly with skirts, trousers, or even jeans for a chic, smart-casual look. The blazers attention to detail, from the notched lapels to the neatly finished stitching, reflects a timeless elegance that elevates any outfit. Perfect for women who want a balance of style, comfort, and professionalism, this blazer is a must-have for any modern wardrobe.</p>', 'classic-women-blazer', 1, 1, 1, '', '', '', 250.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:06:18', 'en', 'default', 1, 589, '2025-12-24 13:29:22', NULL, 1),
