(1042, 'test-122989', 'simple', '', 'Casual Denim Jacket', '<p>The <strong>Casual Denim Jacket</strong> is a versatile wardrobe staple, offering both style and comfort. With a timeless design and durable fabric, it\'s perfect for layering over any outfit, whether you\'re heading to work, out with friends, or enjoying a weekend adventure.</p>', '<p>The <strong>Casual Denim Jacket</strong> is your go-to piece for effortless style. Crafted from high-quality denim, it combines durability with comfort, providing the perfect balance between a structured fit and relaxed ease. Its classic design features a button-front closure, chest pockets, and a flattering, versatile cut that looks great with almost anything in your wardrobe.</p>\n<p>Ideal for layering, this jacket pairs well with t-shirts, dresses, or even hoodies, making it a must-have for all-season wear. Whether youre dressing down for a casual day out or layering it over a cozy sweater for added warmth, the <strong>Casual Denim Jacket</strong> offers both functionality and timeless style.</p>\n<p></p>', 'casual-denim-jacket', 1, 1, 1, '', '', '', 250.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:19:48', 'en', 'default', 1, 591, '2025-12-24 13:45:08', NULL, 1),
