(1044, 'test-15566', 'simple', '', 'Men Classic Cap', '<p>The <strong>Men Classic Cap</strong> is the perfect blend of style and practicality. Made with durable material, this cap offers comfort and sun protection while completing your casual look. Ideal for outdoor activities, sports, or everyday wear.</p>', '<p>Elevate your casual style with the <strong>Men Classic Cap</strong>, designed for both fashion and function. Made from high-quality, breathable fabric, this cap provides a comfortable fit while keeping you shielded from the sun. Its timeless design features a classic curved brim, adjustable strap for the perfect fit, and subtle stitching details, making it a versatile accessory for any wardrobe.</p>\n<p>Whether you\'re heading outdoors for a run, going on a weekend adventure, or just running errands, this cap is the perfect addition to your outfit. Its a must-have for those who value both style and practicality, offering protection from the elements while enhancing your overall look.</p>\n<p>Available in a range of neutral tones, the <strong>Men Classic Cap</strong> complements any casual ensemble, ensuring you stay cool and stylish all year round.</p>', 'men-classic-cap', 1, 1, 1, '', '', '', 185.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:21:17', 'en', 'default', 1, 592, '2025-12-24 13:44:10', NULL, 1),
