(1046, 'test-155', 'simple', '', 'Comfort Fit Jacket', '<p>The <strong>Comfort Fit Jacket</strong> offers a relaxed, stylish look with a perfect balance of comfort and function. Ideal for casual outings or layering, it provides the perfect fit without compromising on style.</p>', '<p>Step into effortless style and comfort with our <strong>Comfort Fit Jacket</strong>, designed for those who want a relaxed yet polished look. This jacket features a loose, flattering fit that allows for easy movement, while still maintaining a sleek silhouette. Made from high-quality, breathable fabric, it provides all-day comfort whether you\'re on the go or simply relaxing.</p>\n<p>Perfect for layering over your favorite tees, shirts, or sweaters, the <strong>Comfort Fit Jacket</strong> is versatile enough for casual outings, errands, or weekend get-togethers. Its stylish design includes classic details like functional pockets, a zipper or button closure, and a modern collar, making it both practical and fashionable.</p>\n<p>Whether you\'re heading out for a walk or meeting friends, the <strong>Comfort Fit Jacket</strong> ensures you stay warm, stylish, and comfortable every step of the way.</p>', 'comfort-fit-jacket', 1, 1, 1, '', '', '', 385.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:24:46', 'en', 'default', 2, 593, '2025-12-24 13:43:19', NULL, 1),
