(1048, 'test-1566', 'simple', '', 'Classic Formal Shirt', '<p>Elevate your professional look with the <strong>Classic Formal Shirt</strong>. Designed for a sharp, tailored fit, this shirt is perfect for business meetings, office wear, or formal events. Comfortable and stylish, its an essential wardrobe staple.</p>', '<p>The <strong>Classic Formal Shirt</strong> is the epitome of sophistication and style, crafted to provide a sharp, clean look for any professional occasion. Made from premium, breathable fabric, this shirt ensures all-day comfort while maintaining a crisp, polished appearance. The tailored fit flatters your figure without being too tight, offering both style and ease of movement.</p>\n<p>Whether worn under a blazer for a business meeting, paired with trousers for the office, or dressed up for a formal event, this versatile shirt is designed to complement any professional wardrobe. With its classic collar, button-down front, and precision stitching, the <strong>Classic Formal Shirt</strong> is a must-have for those who value quality, comfort, and timeless elegance.</p>', 'classic-formal-shirt', 1, 1, 1, '', '', '', 260.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:26:27', 'en', 'default', 1, 594, '2025-12-24 13:41:04', NULL, 1),
