(1050, 'test-12636', 'simple', '', 'Kids Comfort Wear Set', '<p>The <strong>Kids Comfort Wear Set</strong> is perfect for keeping your little one cozy and stylish. Soft, breathable fabric and a relaxed fit make this set ideal for playtime, naptime, or everyday wear.</p>', '<p>Keep your child comfortable and stylish all day long with the <strong>Kids Comfort Wear Set</strong>. Made from soft, breathable fabric, this set ensures maximum comfort whether theyre running around or lounging at home. The relaxed fit allows for plenty of movement, making it perfect for active kids who need clothes that can keep up with their energy.</p>\n<p>The set includes a comfortable top and matching bottoms, designed with playful colors and patterns that your child will love. Whether its a casual playdate, a day at school, or just relaxing at home, the <strong>Kids Comfort Wear Set</strong> provides the perfect combination of style, comfort, and durability.</p>\n<p>Easy to wash and maintain, this set is a must-have for every busy parent looking for a practical yet stylish outfit for their child.</p>', 'kids-comfort-wear-set', 1, 1, 1, '', '', '', 480.0000, NULL, NULL, NULL, 1.0000, '2025-12-16 19:30:20', 'en', 'default', 1, 595, '2025-12-24 13:48:05', NULL, 1),
