(1052, 'test-12256', 'simple', '', 'Cute Sparkle Frock', '<p>Shine bright in our <strong>Cute Sparkle Frock</strong>! This dress combines fun, elegance, and a touch of glamour with its sparkling fabric and playful design. Perfect for parties, celebrations, or any special occasion.</p>', '<p>Add a touch of sparkle to your little ones wardrobe with our <strong>Cute Sparkle Frock</strong>, designed for moments when only the best will do. The dress features a beautifully crafted fabric with just the right amount of shimmer, making it perfect for birthday parties, family celebrations, or any special event where your child deserves to stand out.</p>\n<p>The frock has a flattering fit thats both comfortable and stylish, with delicate details like soft gathers and a flattering A-line shape. Its made from soft, breathable material, ensuring your child feels as good as they look. The vibrant sparkle effect brings an extra layer of charm, ensuring your little one shines in every room they enter.</p>', 'cute-sparkle-frock', 1, 1, 1, '', '', '', 650.0000, NULL, NULL, NULL, 0.2000, '2025-12-16 19:32:15', 'en', 'default', 1, 596, '2025-12-24 13:45:53', NULL, 1),
