INSERT INTO `product_reviews` (`id`, `name`, `title`, `rating`, `comment`, `status`, `product_id`, `customer_id`, `created_at`, `updated_at`) VALUES
(1, 'Tom Smith', 'Incredible Product!', 5, 'This jacket is incredibly warm and comfortable. I love wearing it on cold days or when I\'m going for a hike. It\'s also very stylish and looks great with a pair of jeans or chinos.', 'disapproved', 357, 2, '2023-11-16 06:53:20', '2023-12-01 05:14:45'),
(2, 'Thomas Freeman', 'High Quality & Affordable', 5, 'I can\'t believe how affordable this jacket is for the quality. It\'s well-made and looks great. I\'ve already gotten so many compliments on it.', 'approved', 357, 10, '2023-11-16 07:00:54', '2023-11-16 07:01:09'),
(3, 'Peter Jones', 'Zip Quality not good. :(', 3, 'The zipper on this jacket is very difficult to zip up and down. I\'ve had to have it replaced twice.', 'approved', 357, 5, '2023-11-16 07:03:53', '2023-11-16 07:04:04'),
(4, 'Michael Alvarez', 'Highly Recommend this Product!!', 5, 'I absolutely love this jacket! It\'s so stylish and warm. I\'ve worn it in all kinds of weather, and it\'s always kept me comfortable. The quality is amazing, and I know it will last for years to come. I highly recommend this jacket to anyone looking for a stylish and durable piece of outerwear.', 'approved', 317, 13, '2023-11-16 07:09:02', '2023-11-16 07:11:40'),
(5, 'Dennis Vincent', 'Disappointed with the product!!', 2, 'I was really disappointed with this jacket. It\'s not as warm as I thought it would be, and the zipper is really finicky. I\'ve also had some problems with the stitching coming undone. I would not recommend this jacket to anyone.', 'approved', 317, 11, '2023-11-16 07:11:31', '2023-11-16 07:11:40'),
(6, 'Tracey Williamson', 'Perfect Fit!', 5, 'These jeans are the perfect fit! They\'re so comfortable and flattering, and I love the way they look on me. I\'ve worn them all week, and they\'ve held up great. I would definitely recommend these jeans to anyone looking for a stylish and comfortable pair of denim.', 'approved', 54, 12, '2023-11-16 07:13:57', '2023-11-16 07:16:55'),
(7, 'Nancy Hartman', 'Size not Right!', 3, '\"I was really disappointed with these jeans. The sizing is way off, and they\'re not as comfortable as I thought they would be. I\'ve also had some problems with the color fading. I would not recommend these jeans to anyone.\"', 'approved', 54, 9, '2023-11-16 07:15:30', '2023-11-16 07:16:55'),
(8, 'Mary Smith', 'Stylish and Comfortable! ', 5, '\"These jeans are so comfy and stylish. I love the way they fit me. They\'re also very durable. I\'ve been wearing them for a few weeks now and they\'re still holding up well.\"', 'approved', 54, 4, '2023-11-16 07:16:47', '2023-11-16 07:16:55'),
(9, 'Mary Smith', 'Good Collection but Below average material', 3, '\"These jeans are not as flattering as I thought they would be. They make my legs look shorter. I\'m also not a fan of the material. It\'s too thin and doesn\'t hold its shape well.\"', 'approved', 364, 4, '2023-11-16 07:23:12', '2023-11-16 07:27:59'),
(10, 'Jane Hamilton', 'Durable and very good Fit!! ', 5, '\"These jeans are very durable. I\'ve had them for a 2 month now and they\'re still in great condition & they\'re still holding up well.These jeans are so comfy and stylish. I love the way they fit me.\"', 'approved', 364, 6, '2023-11-16 07:27:30', '2023-11-16 07:27:59'),
(11, 'Nancy Hartman', 'Glad I found this one! ', 5, '\"I\'ve been looking for a kanjivaram saree for years and I\'m so glad I finally found this one. It\'s everything I\'ve ever wanted in a saree. It\'s perfect for any occasion, whether it\'s a special event or just a casual day out.\"', 'approved', 51, 9, '2023-11-16 11:19:38', '2023-11-16 11:28:45'),
(12, 'Jennifer White', 'Absolutely Stunning and Beautiful! ', 5, 'This saree is absolutely stunning! The colors are vibrant and the pattern is intricate and beautiful. It\'s made of the finest silk and it\'s so soft and comfortable to wear.\r\nI\'ve gotten so many compliments on it. ', 'approved', 51, 8, '2023-11-16 11:23:12', '2023-11-16 11:28:45'),
(13, 'John Doe', 'Beautiful Saree but too Expensive', 3, 'This saree is a bit too expensive for my budget. I wish it was a bit more affordable. \r\nThe fabric is beautiful, but it\'s a bit too heavy for my liking.', 'disapproved', 51, 1, '2023-11-16 11:27:03', '2023-12-01 04:40:26'),
(14, 'Tracey Williamson', 'Absolutely in love with it! ', 5, 'I\'m so glad I found this saree,  and I am absolutely in love with it!  \r\nThe fabric is so soft and luxurious It\'s the perfect shade of red for my complexion, and the gold border is simply stunning and I can\'t wait to wear it for my upcoming wedding.\r\nThe colors are vibrant and the patterns are intricate. I\'ve gotten so many compliments on it, and I\'m so glad I invested in it. \r\nI know it will last for years to come.\"', 'approved', 51, 12, '2023-11-16 11:33:00', '2023-11-16 11:33:12'),
(15, 'John Doe', 'Incredible Product!', 5, 'This jacket is incredibly warm and comfortable. I love wearing it on cold days or when I\'m going for a hike. It\'s also very stylish and looks great with a pair of jeans or chinos.', 'pending', 197, 17, '2023-12-01 05:11:56', '2023-12-01 05:11:56'),
(16, 'John Doe', 'Zip Quality is not good. :(', 2, 'The zipper on this jacket is very difficult to zip up and down. I\'ve had to have it replaced twice.', 'approved', 174, 17, '2023-12-01 05:15:03', '2023-12-01 05:20:43'),
(17, 'John Doe', 'This product is absolutely amazing!', 5, 'This product is amazing!  It exceeded my expectations in every way. The quality is top-notch, the design is sleek, and it arrived faster than I anticipated.  I can\'t imagine my life without it now. Worth every penny!  Highly recommended! ', 'approved', 343, 17, '2023-12-01 05:38:00', '2023-12-01 13:22:05'),
(19, 'John Doe', 'Quality is ok', 3, 'This product is decent. It serves its purpose, but it\'s not exceptional.  The quality is okay, and it arrived on time. Nothing extraordinary, but it gets the job done. Might consider exploring other options next time. ', 'approved', 51, 17, '2023-12-01 05:53:28', '2024-03-12 06:02:48'),
(20, 'John Doe', 'This product is absolutely amazing!', 4, 'This product is amazing!  It exceeded my expectations in every way. The quality is top-notch, the design is sleek, and it arrived faster than I anticipated.  I can\'t imagine my life without it now. Worth every penny!  Highly recommended! ', 'approved', 59, 17, '2024-03-12 06:04:01', '2024-03-12 06:04:11'),
(21, 'John Doe', 'Incredible Product!', 5, 'This product is amazing!  It exceeded my expectations in every way. The quality is top-notch, the design is sleek, and it arrived faster than I anticipated.  I can\'t imagine my life without it now. Worth every penny!  Highly recommended! ', 'approved', 479, 17, '2024-03-12 06:04:59', '2024-03-12 06:05:07'),
(22, 'John Davidson', 'Review', 5, 'I recently purchased the Womens Fitness Suit, and I have to say, Im impressed overall! As someone who works out regularly, I was looking for something comfortable yet stylish, and this suit delivered on both fronts.', 'approved', 590, NULL, '2025-12-24 07:23:43', '2025-12-24 07:25:45'),
(23, 'Loren keith', 'Comfort', 5, 'The fit was great once I figured out my size  Id recommend sizing up if youre between sizes, though. The fabric is super soft and breathable, which kept me comfortable during my gym sessions. I also love how flattering the design is. Its the perfect combination of practical and fashionable, and I felt confident wearing it.', 'approved', 590, NULL, '2025-12-24 07:24:59', '2025-12-24 07:25:45'),
(24, 'Sophie Dubois', 'Timeless, Elegant, and Versatile  A Must-Have for Any Wardrobe', 5, 'Love this Classic Womens Blazer! Its perfectly tailored, stylish, and versatile for both work and casual looks. The fabric feels great and doesnt wrinkle, though its a bit snug around the shoulders. Overall, its a must-have for anyone looking for a timeless, chic blazer.', 'approved', 589, NULL, '2025-12-24 07:30:12', '2025-12-24 07:46:00'),
(25, 'Charlotte Weber', 'Charlotte Weber', 5, 'The Fiery Red Classic Middy is a showstopper! The color is eye-catching, and the fit is flattering. Its perfect for making a bold fashion statement. The material is comfortable, but it runs a bit tight around the arms. Still, I love how it instantly adds energy to any outfit!', 'approved', 588, NULL, '2025-12-24 07:31:58', '2025-12-24 07:46:00'),
(26, 'Lena Mller', 'Timeless and Versatile: The Denim Dreamer Jacket', 5, 'The Denim Dreamer Jacket is an absolute wardrobe essential! Its the perfect blend of casual and stylish, making it easy to pair with almost anything. The fit is great, and the denim feels soft but durable. The only downside is that its a bit stiff at first, but after a few wears, it molds perfectly to your body. Highly recommend it for everyday wear!', 'approved', 587, NULL, '2025-12-24 07:32:49', '2025-12-24 07:46:00'),
(27, 'Oliver Thompson', 'Sophisticated and Comfortable: The Classic Formal Shirt', 5, 'The Classic Formal Shirt is a must-have for any wardrobe. The fit is spot-on, giving a sharp and professional look without being too tight or too loose. The fabric feels high-quality and breathable, which is great for all-day wear. The only thing to note is that it wrinkles a bit easily, but its nothing a quick press cant fix. Overall, a reliable and stylish shirt for work or formal events.', 'approved', 594, NULL, '2025-12-24 07:33:50', '2025-12-24 07:46:00'),
(28, 'Marco Santini', 'Perfect Blend of Comfort and Style: The Comfort Fit Jacket', 5, 'The Comfort Fit Jacket is everything I was looking for! Its incredibly comfortable, offering just the right amount of stretch, which makes it perfect for both casual outings and semi-formal events. The fabric feels soft but durable, and the fit is relaxed yet flattering. Its slightly roomy, so if you like a more tailored look, you might want to size down. Overall, its a great, versatile jacket!', 'approved', 593, NULL, '2025-12-24 07:34:54', '2025-12-24 07:46:00'),
(29, 'A Timeless Accessory: The Men Classic Cap', 'Julian Moreau', 5, 'The Men Classic Cap is a great addition to any casual wardrobe. It has a clean, simple design that goes well with almost anything. The material is sturdy, yet comfortable, and the adjustable strap ensures a perfect fit. Its lightweight, making it ideal for sunny days. My only minor issue is that it could use a bit more structure, but overall, its a stylish and functional cap!', 'approved', 592, NULL, '2025-12-24 07:35:48', '2025-12-24 07:45:46'),
(30, 'Sophie Laurent', 'Effortlessly Cool: The Casual Denim Jacket', 5, 'The Casual Denim Jacket is a perfect balance of style and comfort. The fit is relaxed but still flattering, and the denim feels soft yet durable. I love how versatile it is, matching with everything from dresses to t-shirts. It does run a bit large, so Id recommend sizing down for a more fitted look. Overall, a great jacket for laid-back, everyday wear!', 'approved', 591, NULL, '2025-12-24 07:36:59', '2025-12-24 07:45:46'),
(31, 'Isabella Fernandez', 'Sparkle and Shine: The Cute Sparkle Frock', 5, 'The Cute Sparkle Frock is absolutely adorable! The sparkle adds just the right amount of glam, making it perfect for parties or special occasions. The fit is flattering and comfortable, and the fabric feels soft against the skin. The only downside is that the sparkles tend to shed a little, but it\'s not a dealbreaker. Overall, a fun and chic dress that I love to wear!', 'approved', 596, NULL, '2025-12-24 07:38:04', '2025-12-24 07:45:46'),
(32, 'Luca Bianchi', 'Chic and Trendy: The Mini Fashion Jacket', 5, 'The Mini Fashion Jacket is a stylish piece that adds a trendy touch to any outfit. Its lightweight and fits perfectly, giving a sleek, modern look. The fabric feels comfortable, and the cut is flattering. The only thing Id note is that its a bit short, so if you prefer longer jackets, this might not be the one for you. Overall, its a fun and fashionable addition to my wardrobe!', 'approved', 598, NULL, '2025-12-24 07:39:08', '2025-12-24 07:45:46'),
(33, 'Emma Johnson', 'Cozy and Practical: The Kids Comfort Wear Set', 5, 'The Kids Comfort Wear Set is perfect for my little one! The fabric is soft, breathable, and super comfortable for all-day wear. Its easy to put on and move around in, which is ideal for active kids. The colors and design are cute, but I wish the set came in more size options. Overall, a great set for casual days at home or playdates!', 'approved', 595, NULL, '2025-12-24 07:40:44', '2025-12-24 07:45:46'),
(34, 'Nina Mller', 'Stylish and Cozy: The Little Champ Jacket', 5, 'The Little Champ Jacket is a perfect blend of style and comfort for my child. Its warm and soft, yet lightweight enough for everyday wear. The design is adorable, and my little one loves it! The only small downside is that it doesnt have enough stretch for active kids, but overall, its a great jacket for cooler weather.', 'approved', 597, NULL, '2025-12-24 07:41:53', '2025-12-24 07:45:45'),
(35, 'Carlos Garcia', 'Reliable and Convenient: Classic Community Hall Booking', 5, 'The Classic Community Hall Booking service was smooth and hassle-free. Booking the hall was easy, and the staff were very helpful throughout the process. The venue itself is spacious, clean, and perfect for any event. Id recommend it for anyone looking for a straightforward and affordable option for gatherings or celebrations.', 'approved', 548, NULL, '2025-12-24 07:42:46', '2025-12-24 07:45:45'),
(36, 'Ava Peterson', 'Efficient and Professional: Doctor Care Appointment', 5, 'The Doctor Care Appointment service was excellent! Booking was quick and simple, and the doctor was attentive and thorough. I appreciated how easy it was to get an appointment without long wait times. The overall experience was smooth and reassuring, making it a great option for anyone looking for reliable healthcare.', 'approved', 550, NULL, '2025-12-24 07:43:35', '2025-12-24 07:45:45'),
(37, 'Liam OConnor', 'Convenient and Efficient: Doctor Quick Consultation', 5, 'The Doctor Quick Consultation service was exactly what I needed! The appointment was easy to book, and I didnt have to wait long for a response. The doctor was professional and addressed my concerns promptly. Its a great option for anyone looking for fast, reliable advice without the long wait times. Highly recommend it!', 'approved', 557, NULL, '2025-12-24 07:44:24', '2025-12-24 07:45:45'),
(38, 'Sophia Williams', 'Elegant and Seamless: Grand Royal Hall Reservation', 5, 'Booking the Grand Royal Hall was a breeze! The process was smooth, and the staff were extremely helpful. The hall itself is stunningspacious, elegant, and perfect for hosting large events. It added a touch of luxury to our celebration. Highly recommend it for anyone looking for a grand venue!', 'approved', 547, NULL, '2025-12-24 07:45:33', '2025-12-24 07:45:45');
